(10, 8, 1, 'Contoh Zakat', '<p>Saatnya Bayar Zakat. Bersihkan harta anda dengan zakat di Mizan Amanah. Insha Allah mudah, berkah dan amanah.&nbsp;</p><p>Yuk Pelajari tentang Zakat di artikel ini</p><p>1. Zakat Maal -&gt;&nbsp;<a href=\"https://mizanamanah.or.id/update/zakat-maal\" target=\"_blank\">https://mizanamanah.or.id/update/zakat-maal</a><a href=\"https://mizanamanah.or.id/update/zakat-maal\"></a></p><p>2. Zakat Maal Bagian 2 -&gt;&nbsp;<a href=\"https://mizanamanah.or.id/update/zakat-maal-bagian-2\">https://mizanamanah.or.id/update/zakat-maal-bagian-2</a></p>', 'Saatnya Bayar Zakat. Bersihkan harta anda dengan zakat di Mizan Amanah. Insha Allah mudah, berkah dan amanah. \r\n\r\nYuk Pelajari tentang Zakat di artikel ini\r\n\r\n1. Zakat Maal -> https://mizanamanah.or.id/update/zakat-maal\r\n\r\n2. Zakat Maal Bagian 2 -> https://mizanamanah.or.id/update/zakat-maal-bagian-2', '2019-10-08 11:28:31', '2020-01-19 17:32:04'),
(11, 8, 2, 'Contoh Zakat', '<p>Saatnya Bayar Zakat. Bersihkan harta anda dengan zakat di Mizan Amanah. Insha Allah mudah, berkah dan amanah.&nbsp;</p><p>Yuk Pelajari tentang Zakat di artikel ini</p><p>1. Zakat Maal -&gt;&nbsp;<a href=\"https://mizanamanah.or.id/update/zakat-maal\" target=\"_blank\">https://mizanamanah.or.id/update/zakat-maal</a><a href=\"https://mizanamanah.or.id/update/zakat-maal\"></a></p><p>2. Zakat Maal Bagian 2 -&gt;&nbsp;<a href=\"https://mizanamanah.or.id/update/zakat-maal-bagian-2\">https://mizanamanah.or.id/update/zakat-maal-bagian-2</a></p>', 'Saatnya Bayar Zakat. Bersihkan harta anda dengan zakat di Mizan Amanah. Insha Allah mudah, berkah dan amanah. \r\n\r\nYuk Pelajari tentang Zakat di artikel ini\r\n\r\n1. Zakat Maal -> https://mizanamanah.or.id/update/zakat-maal\r\n\r\n2. Zakat Maal Bagian 2 -> https://mizanamanah.or.id/update/zakat-maal-bagian-2', '2019-10-08 11:28:31', '2020-01-19 17:32:04'),
(12, 9, 1, 'Syarat dan Ketentuan', '<p><b>Syarat &amp; Ketentuan Mizan Amanah</b></p><p>Persyaratan Layanan ini berlaku jika Anda melakukan donasi melalui mizanamanah.or.id. Harap membaca Ketentuan Layanan ini dengan seksama karena berisi informasi penting tentang hak dan kewajiban Anda.&nbsp;</p><p>Dengan mengakses atau menggunakan www.mizanamanah.or.id (apakah Anda mendaftar untuk menggunakan Layanan kami atau tidak), Anda setuju untuk terikat secara hukum dengan Syarat dan Ketentuan di website kami serta perubahan yang kami tetapkan dari waktu ke waktu.</p><p>Jika Anda tidak ingin terikat dengan Ketentuan Layanan ini maka Anda tidak boleh menggunakan situs kami.</p><p><br></p><p><b>Tentang Website</b></p><ol><li>Situs web kami memberikan kesempatan untuk membuat kampanye penggalangan donasi secara online untuk mendukung proyek amal di Indonesia serta negara lain yang tidak melanggar hukum. Layanan secara lebih rinci dapat dilihat pada website. Situs web ini memberikan informasi tentang Mizan Amanah, proyek sosial dan organisasi yang ditampilkan di situs ini.</li><li>Harap dicatat bahwa situs web kami hanya tersedia bagi individu yang dapat membentuk kontrak yang mengikat secara hukum berdasarkan undang-undang yang berlaku. Meskipun informasi umum di situs kami sesuai untuk pengguna dari segala umur, Anda harus berusia di atas 18 tahun untuk menggunakan layanan dan metode pembayaran yang ditampilkan di situs kami.</li></ol><p><br></p><p><b>Menggunakan Layanan Website</b></p><p><br></p><ol><li>Untuk menggunakan Layanan kami, Anda harus mengikuti prosedur yang ditetapkan di Situs Web.</li><li>Rincian prosedur pembayaran dan bagaimana kami akan memproses donasi Anda ditampilkan di situs kami.</li><li>Anda dapat membayar donasi dengan transfer bank atau kartu kredit atau kartu debit Anda.</li><li>Kami berusaha memastikan bahwa informasi di situs kami tentang proyek, tujuan pendanaan, dan jumlah donasi terakhir yang diterima akurat. Namun, terkadang ada penundaan dalam memperbarui informasi ini, atau terjadi perubahan target pendanaan proyek sosial. Terkadang, sebuah proyek sosial yang sudah Anda donasikan mungkin akan tidak memenuhi persyaratan Mizan Amanah. Jika ini terjadi, kami dapat menghubungi Anda untuk meminta preferensi Anda untuk proyek mana yang akan Anda alokasikan sebagai pengganti. Jika kami tidak dapat memperoleh informasi dari Anda tentang hal tersebut setelah beberapa waktu, kami berhak mendistribusikan sumbangan Anda ke proyek lain dengan pertimbangan mutlak kami.</li><li>Kami berhak menolak untuk memproses sumbangan yang Anda berikan. Jika sumbangan Anda diterima, kami akan mengkonfirmasi penerimaan Anda dengan mengirimkan email ke alamat email yang Anda berikan saat mendaftar di situs kami. Donasi tersebut kemudian diproses pada tanggal yang tersebut dalam email konfirmasi.<br></li><li>Anda memastikan bahwa semua rincian yang Anda berikan kepada kami untuk tujuan penggunaan layanan yang ditawarkan di situs kami adalah benar dan bahwa kartu kredit atau debit, atau uang elektronik apa pun yang Anda gunakan adalah milik Anda sendiri dan tersedia dana yang cukup untuk menutupi sumbangan yang Anda buat. Kami berhak untuk mendapatkan validasi rincian kartu kredit atau debit Anda atau verifikasi keaslian dan kepemilikan metode pembayaran sebelum melakukan langkah lain untuk memproses donasi Anda jika diperlukan.<br></li><li>Setelah kami mengirimi Anda email yang mengonfirmasi donasi Anda, tidak mungkin sumbangan untuk dikembalikan.<br></li><li>Anda memahami bahwa kami menolak keluhan atas biaya-biaya yang tidak kami cantumkan pada layanan dan syarat ketentuan kami serta biaya tambahan dari pihak ketiga sehubungan transaksi yang Anda lakukan pada website kami, jika ada, seperti biaya transfer antar bank.<br></li><li>Kami tidak memberikan saran akuntansi, pajak atau keuangan dan Anda tidak boleh bergantung pada informasi yang diberikan di situs kami untuk menentukan konsekuensi akuntansi, pajak atau keuangan saat memberikan sumbangan dengan menggunakan Layanan kami.<br></li></ol><p><br></p><p><br></p><p><b>Perubahan pada Website</b></p><ol><li>Kami berhak melakukan perubahan atau koreksi, menangguhkan, atau menghentikan segala aspek situs web kami atau konten atau layanan yang tersedia, termasuk akses Anda ke website kami. Kecuali secara eksplisit dinyatakan sebaliknya, setiap fitur dan konten baru, tunduk pada persyaratan dan ketentuan ini.<br></li><li>Harap dicatat bahwa meskipun kami berusaha memastikan bahwa konten situs web kami akurat, mungkin berisi kesalahan ketik atau ketidakakuratan lainnya.<br></li></ol><p><br></p><p><br></p><p><b>Informasi yang Anda berikan kepada kami</b></p><ol><li>Kebijakan Privasi kami menjelaskan bagaimana kami dapat menggunakan informasi pribadi yang Anda berikan kepada kami saat menggunakan situs web kami. Dengan menerima Persyaratan Layanan ini, Anda juga menerima dan menyetujui Kebijakan Privasi kami.<br></li><li>Selain itu, persyaratan berikut juga berlaku untuk semua pesan, email, pembaruan, foto, saran, konsep atau materi lain yang disampaikan oleh Anda kepada kami (\'Konten\'):<br></li><li>Anda harus memiliki atau berhak atas Konten yang dipublikasikan di situs kami. Semua Konten yang Anda kirimkan harus legal, jujur, mematuhi semua hukum, peraturan, standar dan / atau kode praktik yang berlaku;<br></li><li>Anda harus memastikan bahwa semua Konten yang diserahkan kepada kami tidak melanggar hak cipta, desain, privasi, publisitas, perlindungan data, merek dagang atau hak lainnya dari pihak ketiga manapun, atau cabul, kasar, mengancam, atau memfitnah siapapun atau sebaliknya menjadi tidak sah;<br></li><li>Anda harus memastikan bahwa konten yang Anda publikasikan di website kami semata untuk mendorong pengguna dari situs web untuk memberi sumbangan dengan menggunakan layanan Mizan Amanah; dan<br></li><li>Kami memiliki hak untuk memantau Konten, serta dapat mengedit, menolak atau menghapus Konten. Jika kami yakin tidak sesuai dengan hal di atas, kami berhak untuk memblokir email masuk, mengunggah, komentar dan Konten lainnya.&nbsp;<br></li><li>Anda memberi kami lisensi yang tidak eksklusif, tidak dapat dibatalkan, bebas royalti, di seluruh dunia untuk menerbitkan semua Konten yang Anda unggah di situs kami atau kirimkan kepada kami untuk dipublikasikan. Anda bertanggung jawab penuh atas Konten yang Anda serahkan kepada kami dan Anda akan mengganti kerugian dan harus menjaga nama baik kami secara penuh dan efektif untuk mengganti kerugian atas permintaan dari dan terhadap semua tindakan, klaim, kerugian, pertanggungjawaban, proses, kerusakan, biaya, kewajiban, kehilangan bisnis, kehilangan keuntungan, gangguan bisnis dan kerugian uang atau konsekuensi lainnya (termasuk biaya dan biaya hukum) yang diderita atau ditanggung oleh kami dan timbul secara langsung atau tidak langsung dari penerbitan Konten yang Anda kirimkan kepada kami.<br></li><li>Jika Anda melanggar syarat dan ketentuan ini, maka izin Anda untuk menggunakan situs ini segera berakhir. Kami mempertahankan hak untuk menolak akses ke situs kami pada siapa pun jika kami yakin mereka telah gagal memenuhi persyaratan dan ketentuan ini.<br></li></ol><p><br></p><p><br></p><p><b>Keamanan</b></p><ol><li>Anda bertanggung jawab sepenuhnya dalam semua hal untuk semua penggunaan dan perlindungan kerahasiaan nama pengguna, verifikasi email dan kata sandi yang mungkin diberikan kepada Anda atau dipilih oleh Anda untuk digunakan di situs kami. Anda tidak boleh membagikannya atau mentransfernya ke pihak ketiga manapun. Anda harus segera memberi tahu kami tentang penggunaan yang tidak sah atau pelanggaran keamanan lainnya mengenai situs web kami yang menarik perhatian Anda.<br></li><li>Situs ini kami kelola seaman mungkin dengan memanfaatkan teknologi enkripsi dan menerapkan praktik keamanan dan anti-virus yang secara rutin digunakan dan diadopsi sebagai praktik terbaik. Namun, Anda harus mengerti bahwa setiap situs internet, dan komputer mana pun yang terhubung ke internet, serta semua komunikasi internet, mudah diserang oleh hacker komputer dan virus. Kami akan melakukan semua yang kami bisa untuk melindungi situs ini dan semua komunikasi internet yang terjadi antara kami dan Anda, namun kami tidak dapat bertanggung jawab untuk:<br></li><li>Kerugian yang diakibatkan oleh kegagalan Anda untuk melakukan tindakan pencegahan yang memadai untuk mencegah intersepsi atau gangguan terhadap kesalahan komunikasi tersebut (termasuk, tanpa batasan) serta kelalaian pembaruan firewall dan perangkat lunak anti-virus di komputer Anda sendiri; atau<br></li><li>Kerugian yang timbul dari penggunaan kartu kredit atau debit Anda yang tidak benar atau tidak sah atau bentuk pembayaran lainnya. Jika Anda mengetahui penggunaan penipuan atau kartu Anda, atau jika hilang atau dicuri, Anda harus memberi tahu penerbit kartu Anda.</li></ol><p><br></p><p><b>Penerapan Materi Online</b></p><ol><li>Kecuali ditentukan lain, semua konten dan materi yang dipublikasikan di situs kami disajikan semata-mata untuk penggunaan khusus, pribadi dan non-komersial Anda.<br></li><li>Situs web kami dikendalikan dan dioperasikan oleh Yayasan Mizan Amanah yang berkedudukan di Jakarta, Indonesia. Jika konten yang dipublikasikan di situs web dipasok oleh pihak ketiga, Anda memahami bahwa kami tidak mengontrol atau mendukung konten semacam itu dengan cara apa pun. Semua konten yang dipublikasikan oleh pihak ketiga yang tidak berafiliasi dengan atau berhubungan dengan kami, dipublikasikan dengan itikad baik tetapi kami tidak bertanggung jawab (sejauh diizinkan oleh hukum yang berlaku) atas keakuratan atau isi dari konten tersebut (baik yang dipublikasikan online atau offline) dan penggunaan konten tersebut, kecuali konten yang berhubungan langsung dengan produk yang Anda beli dari kami. Anda bertanggung jawab dan menanggung risiko penuh atas penggunaan website kami dan penggunaan semua informasi yang terkandung di dalamnya.<br></li><li>Kami berusaha memastikan bahwa mizanamanah.or.id mematuhi undang-undang dan peraturan Indonesia. Kami tidak membuat pernyataan bahwa materi di situs kami sesuai atau tersedia untuk digunakan di luar Indonesia. Mereka yang mengunjungi situs kami dari lokasi lain melakukannya berdasarkan inisiatif mereka sendiri dan bertanggung jawab untuk mematuhi semua undang-undang yang berlaku. Jika penggunaan situs web dan / atau tampilan kami, atau penggunaan materi atau konten di situs web atau layanan kami, atau produk yang ditawarkan melalui situs web kami bertentangan dengan atau melanggar hukum yang berlaku di yurisdiksi Anda, Anda tidak diizinkan untuk melihat atau menggunakan situs kami dan Anda harus segera meninggalkan website kami.</li></ol><p><br></p><p><b>Hak Cipta dan Pemantauan</b></p><p><br></p><p>Isi dari website kami dilindungi oleh undang-undang hak cipta dan hak kekayaan intelektual lainnya. Pemilik hak-hak ini adalah Yayasan Mizan Amanah, afiliasinya atau pemberi lisensi pihak ketiga lainnya. Semua nama dan logo produk dan perusahaan yang disebutkan di situs web kami adalah merek dagang, merek layanan atau nama dagang dari pemiliknya masing-masing, termasuk kami. Anda dapat mendownload materi dari situs kami untuk tujuan penggunaan Layanan kami. Namun, Anda tidak boleh mengubah, menyalin, memperbanyak, menerbitkan ulang, mengunggah, mengirim, mentransmisikan atau mendistribusikan, dengan cara apapun atau dengan cara apapun, materi atau informasi apapun atau yang didownload dari situs kami termasuk namun tidak terbatas pada teks, grafik, video, Pesan, kode dan / atau perangkat lunak tanpa persetujuan tertulis dari kami, untuk tujuan lain kecuali bila diizinkan untuk melakukannya.</p><p><br></p><p><br></p><p><b>Situs yang terhubung</b></p><p>Mizan Amanah tidak membuat pernyataan apa pun tentang situs web lain yang dapat Anda akses melalui situs web kami atau yang mungkin tertaut ke situs web kami. Bila Anda mengakses situs web lain, Anda memahami bahwa itu independen dari Mizan Amanah dan kami tidak memiliki kendali atas konten atau ketersediaan situs web tersebut. Selain itu, tautan ke situs web lain tidak berarti bahwa kami mendukung atau menerima tanggung jawab atas konten, atau penggunaan situs web tersebut, dan kami tidak bertanggung jawab atas kehilangan atau kerusakan yang disebabkan atau diduga disebabkan oleh atau Sehubungan dengan penggunaan konten, barang atau layanan yang tersedia di atau melalui situs web atau sumber lain. Setiap kekhawatiran terkait tautan eksternal harus diarahkan ke administrator situs web atau webmaster.<br></p><p><br></p><p><br></p><p><b>Ketersediaan Website</b></p><p>Kami akan mencoba membuat situs web kami tersedia namun tidak dapat menjamin bahwa situs web kami akan beroperasi terus menerus atau tanpa gangguan atau bebas dari kesalahan dan tidak dapat menerima tanggung jawab atas ketidaktersediaannya. Anda tidak boleh mencoba mengganggu pekerjaan yang benar dari situs kami dan, khususnya, Anda tidak boleh berusaha untuk memotong keamanan, merusak, hack, atau mengganggu sistem komputer, server, situs web, router atau perangkat yang terhubung Internet lainnya.<br></p><p><b>Kewajiban</b><br></p><ol><li>Kami berjanji bahwa Layanan kami akan diberikan sesuai keterampilan dan perhatian yang optimal.<br></li><li>Kami mengecualikan semua persyaratan, ketentuan, jaminan, representasi, atau dukungan tersurat maupun tersirat apapun yang berkaitan dengan Layanan kami, situs web kami atau informasi yang diberikan melalui situs web kami.<br></li><li>Kami akan melakukan yang terbaik untuk memastikan bahwa semua bahan dan informasi yang dipublikasikan di situs kami akurat, namun harap dicatat bahwa semua konten, bahan dan informasi di situs kami disediakan berdasarkan apa adanya dan Anda bertanggung jawab penuh dan menanggung risiko untuk Penggunaan situs web kami dan penggunaan semua informasi yang terkandung di dalamnya.<br></li><li>Kami tidak bertanggung jawab atas kerugian atau kerusakan tidak langsung atau konsekuensial, atau untuk kehilangan data, keuntungan, pendapatan atau usaha secara langsung atau tidak langsung dalam setiap kasus, apapun sebabnya, walaupun dapat diperkirakan. Ini berarti bahwa kami tidak akan membayar ganti rugi atas kerugian yang tidak terkait langsung dengan kejadian yang menyebabkan Anda mengklaim diri terhadap kami. Dalam keadaan dimana Anda menderita kerugian atau kerusakan yang timbul dari atau sehubungan dengan tampilan, penggunaan atau kinerja situs web kami atau isinya, maka kami tidak bertanggung jawab atas kehilangan atau kerusakan ini, baik karena ketidakakuratan, kesalahan, kelalaian atau kerugian lainnya.<br></li><li>Jika kami bertanggung jawab kepada Anda atas satu alasan, pertanggungjawaban kami akan terbatas pada jumlah sumbangan yang Anda berikan saat menggunakan Layanan. Batas ini tidak berlaku untuk setiap tanggung jawab yang mungkin kami miliki untuk kematian atau cedera karena akibat kelalaian atau kelalaian kami.<br></li><li>Anda bertanggung jawab untuk memastikan bahwa sistem komputer Anda memenuhi semua spesifikasi teknis yang relevan yang diperlukan untuk menggunakan situs kami dan kompatibel dengan situs web kami. Anda juga mengerti bahwa kami tidak dapat dan tidak bisa menjamin bahwa materi yang tersedia untuk diunduh dari situs web kami akan terbebas dari infeksi, virus, dan / atau kode lain yang memiliki sifat mencemari atau merusak. Anda bertanggung jawab untuk menerapkan prosedur dan pemeriksaan virus yang cukup (termasuk pemeriksaan anti-virus dan pemeriksaan keamanan lainnya) untuk memenuhi persyaratan khusus Anda untuk keakuratan input data dan keluaran.<br></li><li>Keterbatasan dan pengecualian dalam klausul ini hanya berlaku sejauh diizinkan oleh undang-undang yang berlaku.<br></li></ol><p><br></p><p><b>Ketentuan Umum</b><br></p><ol><li>Kami bisa, tapi Anda tidak bisa, memberikan hak dan / atau mentransfer, mensubkontrakkan atau mendelegasikan kewajiban terkait persyaratan dan ketentuan ini, dan / atau mengenakan biaya atau menangani dengan cara lain atas syarat dan ketentuan ini, ataupun hak-hak dan kewajiban kami yang lain. Penugasan, pengalihan, sub-kontrak, pendelegasian, pengisian atau pengikatan yang bertentangan, yang bertentangan dengan pasal ini akanlah tidak efektif. Syarat dan ketentuan ini bersifat pribadi bagi Anda dan untuk keuntungan Anda sendiri dan bukan untuk kepentingan pihak ketiga manapun.<br></li><li>Kami dapat mengubah syarat dan ketentuan ini dari waktu ke waktu dan menetapkan versi baru di situs kami, dan selanjutnya mengatur semua penggunaan situs web kami sesuai versi tersebut. Anda harus memeriksa syarat dan ketentuan di website secara teratur.<br></li><li>Syarat dan ketentuan ini bersama dengan Kebijakan Privasi, dan setiap instruksi metode pembayaran, merupakan keseluruhan kesepakatan antara Anda dan Mizan Amanah. Namun, syarat-syarat ini dapat digantikan oleh pemberitahuan atau persyaratan hukum yang ditetapkan secara tegas yang terdapat pada halaman-halaman tertentu dari situs kami. Anda mengetahui bahwa Anda belum menandatangani perjanjian ini dengan mengandalkan pernyataan, garansi atau representasi yang dibuat oleh Mizan Amanah atau orang lain dan Anda secara tanpa syarat dan tidak bisa dibatalkan melepaskan hak untuk mengklaim kerusakan dan / atau membatalkan persyaratan dan ketentuan ini dengan alasan adanya kekeliruan (selain kelalaian penafsiran) yang tidak tercantum dalam syarat dan ketentuan, kebijakan privasi, formulir pemesanan dan instruksi metode pembayaran.<br></li><li>Jika ketentuan dari syarat dan ketentuan ini menjadi atau dinyatakan tidak sah, tidak benar atau tidak dapat diterapkan dengan alasan apapun, istilah atau ketentuan tersebut dapat dipisahkan dengan syarat dan ketentuan lainnya dan dianggap telah dihapus daripadanya.<br></li><li>Syarat dan ketentuan dan penggunaan situs web kami diatur oleh hukum Indonesia dan Anda tunduk pada yurisdiksi non-eksklusif pengadilan Indonesia.<br></li><li>Kegagalan atau penundaan oleh salah satu pihak dalam melakukan kewajiban atau menjalankan hak berdasarkan syarat dan ketentuan ini bukan merupakan pembebasan dari kewajiban atau hak tersebut.<br></li></ol><p><br></p><p><br></p><p><b>Keluhan dan Pelaporan Kesalahan atau Penyalahgunaan</b></p><p>Jika Anda memiliki keluhan atau ingin melaporkan masalah teknis apapun dengan situs web kami atau penyalahgunaan oleh pengguna lain, hubungi kami melalui email di info@mizanamanah.or.id. Atau dengan mengirim surat ke Mizan Amanah: Jl. Ulujami Raya No.111 Kel. Ulujami Kec. Pesanggrahan Kota Jakrata Selatan, Indonesia.<br></p><p><b><br></b></p><p><b>Pemberitahuan</b><br></p><p>Semua pemberitahuan harus diberikan:<br></p><ol><li>kepada kami melalui email di info@mizanamanah.or.id atau melalui surat ke Mizan Amanah: atau<br></li><li>kepada Anda, baik alamat email atau pos yang Anda berikan selama proses pemesanan.<br></li><li>Pemberitahuan akan dianggap diterima saat email diterima secara penuh (atau pada hari kerja berikutnya jika diterima pada akhir pekan atau libur umum di tempat penerimaan) atau selambatnya 7 hari setelah tanggal pengiriman.<br></li></ol><p><b>Pembaruan</b><br></p><p>Syarat dan ketentuan ini menggantikan semua persyaratan dan ketentuan lain yang berlaku sebelumnya (jika ada) untuk penggunaan situs web kami.<br></p><p>PEMBARUAN TERAKHIR: 5 November 2019</p><div><br></div>', NULL, '2019-11-04 08:10:14', '2019-11-04 08:10:14'),
(13, 9, 2, 'Syarat dan Ketentuan', '<p><b>Syarat &amp; Ketentuan Mizan Amanah</b></p><p>Persyaratan Layanan ini berlaku jika Anda melakukan donasi melalui mizanamanah.or.id. Harap membaca Ketentuan Layanan ini dengan seksama karena berisi informasi penting tentang hak dan kewajiban Anda.&nbsp;</p><p>Dengan mengakses atau menggunakan www.mizanamanah.or.id (apakah Anda mendaftar untuk menggunakan Layanan kami atau tidak), Anda setuju untuk terikat secara hukum dengan Syarat dan Ketentuan di website kami serta perubahan yang kami tetapkan dari waktu ke waktu.</p><p>Jika Anda tidak ingin terikat dengan Ketentuan Layanan ini maka Anda tidak boleh menggunakan situs kami.</p><p><br></p><p><b>Tentang Website</b></p><ol><li>Situs web kami memberikan kesempatan untuk membuat kampanye penggalangan donasi secara online untuk mendukung proyek amal di Indonesia serta negara lain yang tidak melanggar hukum. Layanan secara lebih rinci dapat dilihat pada website. Situs web ini memberikan informasi tentang Mizan Amanah, proyek sosial dan organisasi yang ditampilkan di situs ini.</li><li>Harap dicatat bahwa situs web kami hanya tersedia bagi individu yang dapat membentuk kontrak yang mengikat secara hukum berdasarkan undang-undang yang berlaku. Meskipun informasi umum di situs kami sesuai untuk pengguna dari segala umur, Anda harus berusia di atas 18 tahun untuk menggunakan layanan dan metode pembayaran yang ditampilkan di situs kami.</li></ol><p><br></p><p><b>Menggunakan Layanan Website</b></p><p><br></p><ol><li>Untuk menggunakan Layanan kami, Anda harus mengikuti prosedur yang ditetapkan di Situs Web.</li><li>Rincian prosedur pembayaran dan bagaimana kami akan memproses donasi Anda ditampilkan di situs kami.</li><li>Anda dapat membayar donasi dengan transfer bank atau kartu kredit atau kartu debit Anda.</li><li>Kami berusaha memastikan bahwa informasi di situs kami tentang proyek, tujuan pendanaan, dan jumlah donasi terakhir yang diterima akurat. Namun, terkadang ada penundaan dalam memperbarui informasi ini, atau terjadi perubahan target pendanaan proyek sosial. Terkadang, sebuah proyek sosial yang sudah Anda donasikan mungkin akan tidak memenuhi persyaratan Mizan Amanah. Jika ini terjadi, kami dapat menghubungi Anda untuk meminta preferensi Anda untuk proyek mana yang akan Anda alokasikan sebagai pengganti. Jika kami tidak dapat memperoleh informasi dari Anda tentang hal tersebut setelah beberapa waktu, kami berhak mendistribusikan sumbangan Anda ke proyek lain dengan pertimbangan mutlak kami.</li><li>Kami berhak menolak untuk memproses sumbangan yang Anda berikan. Jika sumbangan Anda diterima, kami akan mengkonfirmasi penerimaan Anda dengan mengirimkan email ke alamat email yang Anda berikan saat mendaftar di situs kami. Donasi tersebut kemudian diproses pada tanggal yang tersebut dalam email konfirmasi.<br></li><li>Anda memastikan bahwa semua rincian yang Anda berikan kepada kami untuk tujuan penggunaan layanan yang ditawarkan di situs kami adalah benar dan bahwa kartu kredit atau debit, atau uang elektronik apa pun yang Anda gunakan adalah milik Anda sendiri dan tersedia dana yang cukup untuk menutupi sumbangan yang Anda buat. Kami berhak untuk mendapatkan validasi rincian kartu kredit atau debit Anda atau verifikasi keaslian dan kepemilikan metode pembayaran sebelum melakukan langkah lain untuk memproses donasi Anda jika diperlukan.<br></li><li>Setelah kami mengirimi Anda email yang mengonfirmasi donasi Anda, tidak mungkin sumbangan untuk dikembalikan.<br></li><li>Anda memahami bahwa kami menolak keluhan atas biaya-biaya yang tidak kami cantumkan pada layanan dan syarat ketentuan kami serta biaya tambahan dari pihak ketiga sehubungan transaksi yang Anda lakukan pada website kami, jika ada, seperti biaya transfer antar bank.<br></li><li>Kami tidak memberikan saran akuntansi, pajak atau keuangan dan Anda tidak boleh bergantung pada informasi yang diberikan di situs kami untuk menentukan konsekuensi akuntansi, pajak atau keuangan saat memberikan sumbangan dengan menggunakan Layanan kami.<br></li></ol><p><br></p><p><br></p><p><b>Perubahan pada Website</b></p><ol><li>Kami berhak melakukan perubahan atau koreksi, menangguhkan, atau menghentikan segala aspek situs web kami atau konten atau layanan yang tersedia, termasuk akses Anda ke website kami. Kecuali secara eksplisit dinyatakan sebaliknya, setiap fitur dan konten baru, tunduk pada persyaratan dan ketentuan ini.<br></li><li>Harap dicatat bahwa meskipun kami berusaha memastikan bahwa konten situs web kami akurat, mungkin berisi kesalahan ketik atau ketidakakuratan lainnya.<br></li></ol><p><br></p><p><br></p><p><b>Informasi yang Anda berikan kepada kami</b></p><ol><li>Kebijakan Privasi kami menjelaskan bagaimana kami dapat menggunakan informasi pribadi yang Anda berikan kepada kami saat menggunakan situs web kami. Dengan menerima Persyaratan Layanan ini, Anda juga menerima dan menyetujui Kebijakan Privasi kami.<br></li><li>Selain itu, persyaratan berikut juga berlaku untuk semua pesan, email, pembaruan, foto, saran, konsep atau materi lain yang disampaikan oleh Anda kepada kami (\'Konten\'):<br></li><li>Anda harus memiliki atau berhak atas Konten yang dipublikasikan di situs kami. Semua Konten yang Anda kirimkan harus legal, jujur, mematuhi semua hukum, peraturan, standar dan / atau kode praktik yang berlaku;<br></li><li>Anda harus memastikan bahwa semua Konten yang diserahkan kepada kami tidak melanggar hak cipta, desain, privasi, publisitas, perlindungan data, merek dagang atau hak lainnya dari pihak ketiga manapun, atau cabul, kasar, mengancam, atau memfitnah siapapun atau sebaliknya menjadi tidak sah;<br></li><li>Anda harus memastikan bahwa konten yang Anda publikasikan di website kami semata untuk mendorong pengguna dari situs web untuk memberi sumbangan dengan menggunakan layanan Mizan Amanah; dan<br></li><li>Kami memiliki hak untuk memantau Konten, serta dapat mengedit, menolak atau menghapus Konten. Jika kami yakin tidak sesuai dengan hal di atas, kami berhak untuk memblokir email masuk, mengunggah, komentar dan Konten lainnya.&nbsp;<br></li><li>Anda memberi kami lisensi yang tidak eksklusif, tidak dapat dibatalkan, bebas royalti, di seluruh dunia untuk menerbitkan semua Konten yang Anda unggah di situs kami atau kirimkan kepada kami untuk dipublikasikan. Anda bertanggung jawab penuh atas Konten yang Anda serahkan kepada kami dan Anda akan mengganti kerugian dan harus menjaga nama baik kami secara penuh dan efektif untuk mengganti kerugian atas permintaan dari dan terhadap semua tindakan, klaim, kerugian, pertanggungjawaban, proses, kerusakan, biaya, kewajiban, kehilangan bisnis, kehilangan keuntungan, gangguan bisnis dan kerugian uang atau konsekuensi lainnya (termasuk biaya dan biaya hukum) yang diderita atau ditanggung oleh kami dan timbul secara langsung atau tidak langsung dari penerbitan Konten yang Anda kirimkan kepada kami.<br></li><li>Jika Anda melanggar syarat dan ketentuan ini, maka izin Anda untuk menggunakan situs ini segera berakhir. Kami mempertahankan hak untuk menolak akses ke situs kami pada siapa pun jika kami yakin mereka telah gagal memenuhi persyaratan dan ketentuan ini.<br></li></ol><p><br></p><p><br></p><p><b>Keamanan</b></p><ol><li>Anda bertanggung jawab sepenuhnya dalam semua hal untuk semua penggunaan dan perlindungan kerahasiaan nama pengguna, verifikasi email dan kata sandi yang mungkin diberikan kepada Anda atau dipilih oleh Anda untuk digunakan di situs kami. Anda tidak boleh membagikannya atau mentransfernya ke pihak ketiga manapun. Anda harus segera memberi tahu kami tentang penggunaan yang tidak sah atau pelanggaran keamanan lainnya mengenai situs web kami yang menarik perhatian Anda.<br></li><li>Situs ini kami kelola seaman mungkin dengan memanfaatkan teknologi enkripsi dan menerapkan praktik keamanan dan anti-virus yang secara rutin digunakan dan diadopsi sebagai praktik terbaik. Namun, Anda harus mengerti bahwa setiap situs internet, dan komputer mana pun yang terhubung ke internet, serta semua komunikasi internet, mudah diserang oleh hacker komputer dan virus. Kami akan melakukan semua yang kami bisa untuk melindungi situs ini dan semua komunikasi internet yang terjadi antara kami dan Anda, namun kami tidak dapat bertanggung jawab untuk:<br></li><li>Kerugian yang diakibatkan oleh kegagalan Anda untuk melakukan tindakan pencegahan yang memadai untuk mencegah intersepsi atau gangguan terhadap kesalahan komunikasi tersebut (termasuk, tanpa batasan) serta kelalaian pembaruan firewall dan perangkat lunak anti-virus di komputer Anda sendiri; atau<br></li><li>Kerugian yang timbul dari penggunaan kartu kredit atau debit Anda yang tidak benar atau tidak sah atau bentuk pembayaran lainnya. Jika Anda mengetahui penggunaan penipuan atau kartu Anda, atau jika hilang atau dicuri, Anda harus memberi tahu penerbit kartu Anda.</li></ol><p><br></p><p><b>Penerapan Materi Online</b></p><ol><li>Kecuali ditentukan lain, semua konten dan materi yang dipublikasikan di situs kami disajikan semata-mata untuk penggunaan khusus, pribadi dan non-komersial Anda.<br></li><li>Situs web kami dikendalikan dan dioperasikan oleh Yayasan Mizan Amanah yang berkedudukan di Jakarta, Indonesia. Jika konten yang dipublikasikan di situs web dipasok oleh pihak ketiga, Anda memahami bahwa kami tidak mengontrol atau mendukung konten semacam itu dengan cara apa pun. Semua konten yang dipublikasikan oleh pihak ketiga yang tidak berafiliasi dengan atau berhubungan dengan kami, dipublikasikan dengan itikad baik tetapi kami tidak bertanggung jawab (sejauh diizinkan oleh hukum yang berlaku) atas keakuratan atau isi dari konten tersebut (baik yang dipublikasikan online atau offline) dan penggunaan konten tersebut, kecuali konten yang berhubungan langsung dengan produk yang Anda beli dari kami. Anda bertanggung jawab dan menanggung risiko penuh atas penggunaan website kami dan penggunaan semua informasi yang terkandung di dalamnya.<br></li><li>Kami berusaha memastikan bahwa mizanamanah.or.id mematuhi undang-undang dan peraturan Indonesia. Kami tidak membuat pernyataan bahwa materi di situs kami sesuai atau tersedia untuk digunakan di luar Indonesia. Mereka yang mengunjungi situs kami dari lokasi lain melakukannya berdasarkan inisiatif mereka sendiri dan bertanggung jawab untuk mematuhi semua undang-undang yang berlaku. Jika penggunaan situs web dan / atau tampilan kami, atau penggunaan materi atau konten di situs web atau layanan kami, atau produk yang ditawarkan melalui situs web kami bertentangan dengan atau melanggar hukum yang berlaku di yurisdiksi Anda, Anda tidak diizinkan untuk melihat atau menggunakan situs kami dan Anda harus segera meninggalkan website kami.</li></ol><p><br></p><p><b>Hak Cipta dan Pemantauan</b></p><p><br></p><p>Isi dari website kami dilindungi oleh undang-undang hak cipta dan hak kekayaan intelektual lainnya. Pemilik hak-hak ini adalah Yayasan Mizan Amanah, afiliasinya atau pemberi lisensi pihak ketiga lainnya. Semua nama dan logo produk dan perusahaan yang disebutkan di situs web kami adalah merek dagang, merek layanan atau nama dagang dari pemiliknya masing-masing, termasuk kami. Anda dapat mendownload materi dari situs kami untuk tujuan penggunaan Layanan kami. Namun, Anda tidak boleh mengubah, menyalin, memperbanyak, menerbitkan ulang, mengunggah, mengirim, mentransmisikan atau mendistribusikan, dengan cara apapun atau dengan cara apapun, materi atau informasi apapun atau yang didownload dari situs kami termasuk namun tidak terbatas pada teks, grafik, video, Pesan, kode dan / atau perangkat lunak tanpa persetujuan tertulis dari kami, untuk tujuan lain kecuali bila diizinkan untuk melakukannya.</p><p><br></p><p><br></p><p><b>Situs yang terhubung</b></p><p>Mizan Amanah tidak membuat pernyataan apa pun tentang situs web lain yang dapat Anda akses melalui situs web kami atau yang mungkin tertaut ke situs web kami. Bila Anda mengakses situs web lain, Anda memahami bahwa itu independen dari Mizan Amanah dan kami tidak memiliki kendali atas konten atau ketersediaan situs web tersebut. Selain itu, tautan ke situs web lain tidak berarti bahwa kami mendukung atau menerima tanggung jawab atas konten, atau penggunaan situs web tersebut, dan kami tidak bertanggung jawab atas kehilangan atau kerusakan yang disebabkan atau diduga disebabkan oleh atau Sehubungan dengan penggunaan konten, barang atau layanan yang tersedia di atau melalui situs web atau sumber lain. Setiap kekhawatiran terkait tautan eksternal harus diarahkan ke administrator situs web atau webmaster.<br></p><p><br></p><p><br></p><p><b>Ketersediaan Website</b></p><p>Kami akan mencoba membuat situs web kami tersedia namun tidak dapat menjamin bahwa situs web kami akan beroperasi terus menerus atau tanpa gangguan atau bebas dari kesalahan dan tidak dapat menerima tanggung jawab atas ketidaktersediaannya. Anda tidak boleh mencoba mengganggu pekerjaan yang benar dari situs kami dan, khususnya, Anda tidak boleh berusaha untuk memotong keamanan, merusak, hack, atau mengganggu sistem komputer, server, situs web, router atau perangkat yang terhubung Internet lainnya.<br></p><p><b>Kewajiban</b><br></p><ol><li>Kami berjanji bahwa Layanan kami akan diberikan sesuai keterampilan dan perhatian yang optimal.<br></li><li>Kami mengecualikan semua persyaratan, ketentuan, jaminan, representasi, atau dukungan tersurat maupun tersirat apapun yang berkaitan dengan Layanan kami, situs web kami atau informasi yang diberikan melalui situs web kami.<br></li><li>Kami akan melakukan yang terbaik untuk memastikan bahwa semua bahan dan informasi yang dipublikasikan di situs kami akurat, namun harap dicatat bahwa semua konten, bahan dan informasi di situs kami disediakan berdasarkan apa adanya dan Anda bertanggung jawab penuh dan menanggung risiko untuk Penggunaan situs web kami dan penggunaan semua informasi yang terkandung di dalamnya.<br></li><li>Kami tidak bertanggung jawab atas kerugian atau kerusakan tidak langsung atau konsekuensial, atau untuk kehilangan data, keuntungan, pendapatan atau usaha secara langsung atau tidak langsung dalam setiap kasus, apapun sebabnya, walaupun dapat diperkirakan. Ini berarti bahwa kami tidak akan membayar ganti rugi atas kerugian yang tidak terkait langsung dengan kejadian yang menyebabkan Anda mengklaim diri terhadap kami. Dalam keadaan dimana Anda menderita kerugian atau kerusakan yang timbul dari atau sehubungan dengan tampilan, penggunaan atau kinerja situs web kami atau isinya, maka kami tidak bertanggung jawab atas kehilangan atau kerusakan ini, baik karena ketidakakuratan, kesalahan, kelalaian atau kerugian lainnya.<br></li><li>Jika kami bertanggung jawab kepada Anda atas satu alasan, pertanggungjawaban kami akan terbatas pada jumlah sumbangan yang Anda berikan saat menggunakan Layanan. Batas ini tidak berlaku untuk setiap tanggung jawab yang mungkin kami miliki untuk kematian atau cedera karena akibat kelalaian atau kelalaian kami.<br></li><li>Anda bertanggung jawab untuk memastikan bahwa sistem komputer Anda memenuhi semua spesifikasi teknis yang relevan yang diperlukan untuk menggunakan situs kami dan kompatibel dengan situs web kami. Anda juga mengerti bahwa kami tidak dapat dan tidak bisa menjamin bahwa materi yang tersedia untuk diunduh dari situs web kami akan terbebas dari infeksi, virus, dan / atau kode lain yang memiliki sifat mencemari atau merusak. Anda bertanggung jawab untuk menerapkan prosedur dan pemeriksaan virus yang cukup (termasuk pemeriksaan anti-virus dan pemeriksaan keamanan lainnya) untuk memenuhi persyaratan khusus Anda untuk keakuratan input data dan keluaran.<br></li><li>Keterbatasan dan pengecualian dalam klausul ini hanya berlaku sejauh diizinkan oleh undang-undang yang berlaku.<br></li></ol><p><br></p><p><b>Ketentuan Umum</b><br></p><ol><li>Kami bisa, tapi Anda tidak bisa, memberikan hak dan / atau mentransfer, mensubkontrakkan atau mendelegasikan kewajiban terkait persyaratan dan ketentuan ini, dan / atau mengenakan biaya atau menangani dengan cara lain atas syarat dan ketentuan ini, ataupun hak-hak dan kewajiban kami yang lain. Penugasan, pengalihan, sub-kontrak, pendelegasian, pengisian atau pengikatan yang bertentangan, yang bertentangan dengan pasal ini akanlah tidak efektif. Syarat dan ketentuan ini bersifat pribadi bagi Anda dan untuk keuntungan Anda sendiri dan bukan untuk kepentingan pihak ketiga manapun.<br></li><li>Kami dapat mengubah syarat dan ketentuan ini dari waktu ke waktu dan menetapkan versi baru di situs kami, dan selanjutnya mengatur semua penggunaan situs web kami sesuai versi tersebut. Anda harus memeriksa syarat dan ketentuan di website secara teratur.<br></li><li>Syarat dan ketentuan ini bersama dengan Kebijakan Privasi, dan setiap instruksi metode pembayaran, merupakan keseluruhan kesepakatan antara Anda dan Mizan Amanah. Namun, syarat-syarat ini dapat digantikan oleh pemberitahuan atau persyaratan hukum yang ditetapkan secara tegas yang terdapat pada halaman-halaman tertentu dari situs kami. Anda mengetahui bahwa Anda belum menandatangani perjanjian ini dengan mengandalkan pernyataan, garansi atau representasi yang dibuat oleh Mizan Amanah atau orang lain dan Anda secara tanpa syarat dan tidak bisa dibatalkan melepaskan hak untuk mengklaim kerusakan dan / atau membatalkan persyaratan dan ketentuan ini dengan alasan adanya kekeliruan (selain kelalaian penafsiran) yang tidak tercantum dalam syarat dan ketentuan, kebijakan privasi, formulir pemesanan dan instruksi metode pembayaran.<br></li><li>Jika ketentuan dari syarat dan ketentuan ini menjadi atau dinyatakan tidak sah, tidak benar atau tidak dapat diterapkan dengan alasan apapun, istilah atau ketentuan tersebut dapat dipisahkan dengan syarat dan ketentuan lainnya dan dianggap telah dihapus daripadanya.<br></li><li>Syarat dan ketentuan dan penggunaan situs web kami diatur oleh hukum Indonesia dan Anda tunduk pada yurisdiksi non-eksklusif pengadilan Indonesia.<br></li><li>Kegagalan atau penundaan oleh salah satu pihak dalam melakukan kewajiban atau menjalankan hak berdasarkan syarat dan ketentuan ini bukan merupakan pembebasan dari kewajiban atau hak tersebut.<br></li></ol><p><br></p><p><br></p><p><b>Keluhan dan Pelaporan Kesalahan atau Penyalahgunaan</b></p><p>Jika Anda memiliki keluhan atau ingin melaporkan masalah teknis apapun dengan situs web kami atau penyalahgunaan oleh pengguna lain, hubungi kami melalui email di info@mizanamanah.or.id. Atau dengan mengirim surat ke Mizan Amanah: Jl. Ulujami Raya No.111 Kel. Ulujami Kec. Pesanggrahan Kota Jakrata Selatan, Indonesia.<br></p><p><b><br></b></p><p><b>Pemberitahuan</b><br></p><p>Semua pemberitahuan harus diberikan:<br></p><ol><li>kepada kami melalui email di info@mizanamanah.or.id atau melalui surat ke Mizan Amanah: atau<br></li><li>kepada Anda, baik alamat email atau pos yang Anda berikan selama proses pemesanan.<br></li><li>Pemberitahuan akan dianggap diterima saat email diterima secara penuh (atau pada hari kerja berikutnya jika diterima pada akhir pekan atau libur umum di tempat penerimaan) atau selambatnya 7 hari setelah tanggal pengiriman.<br></li></ol><p><b>Pembaruan</b><br></p><p>Syarat dan ketentuan ini menggantikan semua persyaratan dan ketentuan lain yang berlaku sebelumnya (jika ada) untuk penggunaan situs web kami.<br></p><p>PEMBARUAN TERAKHIR: 5 November 2019</p><div><br></div>', NULL, '2019-11-04 08:10:14', '2019-11-04 08:10:14'),
(14, 10, 1, 'Ketentuan Privasi', '<p><b>1.&nbsp; Pengumpulan Informasi</b></p><p>Kami mengumpulkan informasi dari Anda ketika Anda mendaftar pada situs kami, masuk ke akun Anda, melakukan donasi, dan/atau ketika Anda keluar. Data yang dikumpulkan mencakup nama Anda, alamat email, nomor telepon, dan/atau kartu kredit.<br></p><p>Selain itu, kami menerima dan merekam informasi secara otomatis dari komputer dan peramban Anda, termasuk alamat IP Anda, perlengakapan perangkat keras dan lunak Anda, dan halaman yang Anda minta.<br></p><p><br></p><p><b>2.&nbsp; Penggunaan Informasi</b><br></p><p>Segala informasi yang kami kumpulkan dari Anda dapat digunakan untuk:<br></p><p>•<span style=\"white-space: pre;\">	</span>Personalisasi pengalaman dan tanggapan Anda sesuai kebutuhan pribadi Anda<br></p><p>•<span style=\"white-space:pre\">	</span>Menyediakan konten iklan yang disesuaikan</p><p>•<span style=\"white-space:pre\">	</span>Meningkatkan situs web kami</p><p>•<span style=\"white-space:pre\">	</span>Meningkatkan layanan pelanggan dan mendukung kebutuhan Anda</p><p>•<span style=\"white-space:pre\">	</span>Menghubungi Anda lewat email</p><p>•<span style=\"white-space:pre\">	</span>Mengatur kontes, promo, atau survei</p><p><b><br></b></p><p><b>3. Privasi E-Dagang</b><br></p><p>Kami adalah pemilik tunggal dari informasi yang dikumpulkan pada situs ini. Informasi pribadi Anda yang dapat diidentifikasi tidak akan dijual, dipertukarkan, ditransfer, atau diberikan kepada perusahaan lain dengan alasan apa pun juga, tanpa mendapatkan izin Anda, selain dari hanya semata-mata untuk memenuhi permohonan dan/ atau transaksi, misalnya untuk pengiriman laporan proyek sosial.<br></p><p><br></p><p><b>4. Pengungkapan Pihak Ketiga</b><br></p><p>Kami tidak menjual, memperdagangkan, atau pun memindahkan keluar dari pihak kami informasi pribadi Anda yang dapat diidentifikasi. Kami tidak mengikutkan pihak ketiga tepercaya yang membantu kami dalam mengoperasikan situs web kami atau menyelenggarakan aktvitas kami, selama semua pihak setuju untuk menjaga kerahasiaan informasi ini.<br></p><p>Kami meyakini akan pentingnya berbagi informasi dalam rangka menyelidiki, mencegah, atau mengambil tindakan menyangkut aktivitas ilegal, dugaan penipuan, keadaan yang melibatkan ancaman terhadap keamanan fisik seseorang, pelanggaran atas syarat-syarat penggunaan kami, atau hal lain yang diwajibkan oleh hukum.<br></p><p>Namun, informasi bukan privat dapat diberikan kepada pihak lain untuk pemasaran, pariwara, atau penggunaan lain.<br></p><p><b><br></b></p><p><b>5. Proteksi Informasi</b><br></p><p>Kami menerapkan berbagai langkah keamanan guna menjaga keamanan informasi pribadi Anda. Kami menggunakan enripsi teknologi mutakhir untuk memproteksi informasi sensitif yang dikirimkan secara online. VpnMentor juga memproteksi informasi Anda secara offline. Kami mengaryakan mereka yang perlu mengerjakan pekerjaan khusus (contohnya, penagihan atau layanan pelanggan) diberikan akses ke informasi pribadi yang dapat diidentifikasi. Komputer/server yang digunakan untuk menyimpan informasi pribadi yang dapat diidentifikasi disimpan dalam lingkungan yang aman.<br></p><p><i>Apakah kami menggunakan kuki?</i><br></p><p>Ya. Kuki kami meningkatkan akses ke situs kami dan mengenali pengunjung yang kembali lagi. Lagi pula, kuki kami memperkaya pengalaman pengguna dengan melacak dan menarget minat mereka. Namun, penggunaan kuki ini, tidak mungkin dapat dikaitkan dengan informasi pribadi yang dapat diidentifikasi pada situs kami.<br></p><p><br></p><p><b>6. Berhenti Berlangganan<br></b></p><p>Kami menggunakan alamat email yang Anda berikan untuk mengirimi Anda informasi dan pembaruan menyangkut .menyangkut transaksi Anda, berita berkala lembaga, informasi mengenai proyek sosial, dll. Bila kapan saja Anda ingin berhenti menerima email kami di masa mendatang, kami memasukkan informasi mendetail informasi berhenti berlangganan di bawah tiap-tiap email.<br></p><p><b>7. Persetujuan</b><br></p><p>Dengan menggunakan situs kami, Anda setuju dengan kebijakan privasi kami.</p>', NULL, '2019-11-04 08:12:56', '2019-11-04 08:13:08'),
