(32, 20, 1, 'Dermas Express', '<p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><img src=\"http://derma-express.com/assets/admin/assets/media/base64_to_image/Icon_5e6a432cbf047.png\" style=\"font-size: 12pt; width: 287px;\"><br></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b><o:p></o:p></b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b><o:p></o:p></b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">DERMA EXPRESS lahir dengan impian dapat memenuhi kebutuhan segala.&nbsp;<span style=\"font-size: 12pt; font-family: Poppins, Helvetica, sans-serif;\">lapisan masyarakat agar dapat memiliki wajah yang proposional,</span></p><div style=\"text-align: center;\"><span style=\"font-size: 12pt;\">kulit yang sehat dan awet muda dengan harga terjangkau.&nbsp;</span><span style=\"font-size: 12pt;\">Sebab kami yakin bahwa wajah proposional dan kulit yang sehat merupakan</span></div><div style=\"text-align: center;\"><span style=\"font-size: 12pt;\">investasi masa depan.</span></div><p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>Derma Express<o:p></o:p></b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">Kini Wajah Sehat dan Proposional Bukan Hanya Sekedar Impian<o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>FILOSOFI<o:p></o:p></b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">Menyadari bahwa penampilan dan kulit yang sehat merupakan hal yang menunjang dalam berbagai aspek kehidupan,</p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">maka kami menghadirkan Derma Express yang&nbsp;<span style=\"font-size: 12pt;\">dapat dijangkau oleh semua kalangan.</span></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>Mengapa DERMA EXPRESS ?<o:p></o:p></b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; text-align: center;\"></p><div style=\"text-align: center;\"><span style=\"font-size: 12pt;\">Memiliki dokter yang ahli di bidang estetika medis</span></div><div style=\"text-align: center;\"><span style=\"font-size: 12pt;\">Bagi kami wajah dan kulit anda adalah investasi masa depan anda.</span></div><p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">Dengan wajah dan kulit yang sehat dapat meningkatkan aspek kehidupan anda<o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">Untuk mendapatkan wajah proposional dan kulit yang sehat itu sangat ekonomis dengan DERMA EXPRESS<o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>VISI<o:p></o:p></b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">Menjadikan seluruh pria dan wanita Indonesia berpenampilan menarik dengan harga yang ekonomis<o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>MISI<o:p></o:p></b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">Mengedukasi masyarakat bahwa penampilan luar merupakan salah satu aspek penting dalam kehidupan modern serta memajukan dunia estetika medis di Indonesia<o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>&nbsp;</b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>Teknologi Kami<o:p></o:p></b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>Aptos Thread Lifting<o:p></o:p></b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">Aptos merupakan benang peremajaan Light Lift - benang yang terbuat dari bahan bioabsorbable yang sepenuhnya dihilangkan dari organisme dalam 360 hari.<o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>Meso Theraphy<o:p></o:p></b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">tujuannya adalah untuk membersihkan dan mengantioksidan, produk unik yang tidak dapat Anda temukan di rentang lain.<o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>Laser Light Theraphy<o:p></o:p></b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">treatment dengan menggunakan sinar yang difilter untuk menghasilkan panjang gelombang tertentu dan menghasilkan warna-warna yang spesifik</p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">untuk mengatasi masalah kulit yang berbeda-beda, interaksi sinar disampaikan melalui Light Emitting Dioda (LED), menyebabkan bio-stimulasi pada sel kulit.<o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">Terapi Laser Light Therapy tidak mengandung UVA dan UVB yang dapat merusak kulit sehingga aman dan tanpa rasa sakit.</p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><br></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><img src=\"http://derma-express.com/assets/admin/assets/media/base64_to_image/Icon_5e6a43a9147da.png\" style=\"width: 747px;\"><br></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><br></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>KLINIK<o:p></o:p></b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">Jl. Utan Kayu no. 79B &amp; 79C<o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; text-align: center;\"></p><div style=\"text-align: center;\"><b style=\"font-size: 12pt;\">SERPONG</b></div><div style=\"text-align: center;\"><span style=\"font-size: 12pt;\">Gading Serpong</span></div><div style=\"text-align: center;\"><span style=\"font-size: 12pt;\">Ruko Diamond III No 12-15, Jalan Gading Golf Boulevard,</span></div><p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">Gading Serpong, Pakulonan Bar., Kec. Klp. Dua, Kota Tangerang, Banten 15810<o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>Media Sosial<o:p></o:p></b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">INSTAGRAM&nbsp; &nbsp; : @DERMA_EXPRESS<o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; text-align: center;\"><o:p></o:p><o:p></o:p><o:p></o:p><o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">TWITTER &nbsp;&nbsp;&nb