tkan aspek kehidupan anda<o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">Untuk mendapatkan wajah proposional dan kulit yang sehat itu sangat ekonomis dengan DERMA EXPRESS<o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>VISI<o:p></o:p></b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">Menjadikan seluruh pria dan wanita Indonesia berpenampilan menarik dengan harga yang ekonomis<o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>MISI<o:p></o:p></b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">Mengedukasi masyarakat bahwa penampilan luar merupakan salah satu aspek penting dalam kehidupan modern serta memajukan dunia estetika medis di Indonesia<o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>&nbsp;</b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-fa