ik</p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">untuk mengatasi masalah kulit yang berbeda-beda, interaksi sinar disampaikan melalui Light Emitting Dioda (LED), menyebabkan bio-stimulasi pada sel kulit.<o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\">Terapi Laser Light Therapy tidak mengandung UVA dan UVB yang dapat merusak kulit sehingga aman dan tanpa rasa sakit.</p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><br></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><img src=\"http://derma-express.com/assets/admin/assets/media/base64_to_image/Icon_5e6a43a9147da.png\" style=\"width: 747px;\"><br></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><br></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>KLINIK<o: