(35, 21, 2, 'Profile', '<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>Tentang Kami<o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">DERMA EXPRESS lahir dengan impian dapat memenuhi kebutuhan segala lapisan masyarakat agar dapat memiliki wajah yang proposional,<br>kulit yang sehat dan awet muda dengan harga terjangkau.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">Sebab kami yakin bahwa wajah proposional dan kulit yang sehat merupakan<br>investasi masa depan.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>Derma Express<o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">Kini Wajah Sehat dan Proposional Bukan Hanya Sekedar Impian<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>FILOSOFI<o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">Menyadari bahwa penampilan dan kulit yang sehat merupakan hal yang menunjang dalam berbagai aspek kehidupan, maka kami menghadirkan Derma Express yang<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">dapat dijangkau oleh semua kalangan.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>Mengapa DERMA EXPRESS ?<o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">Memiliki dokter yang ahli di bidang estetika medis<br>Bagi kami wajah dan kulit anda adalah investasi masa depan anda<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">Dengan wajah dan kulit yang sehat dapat meningkatkan aspek kehidupan anda<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">Untuk mendapatkan wajah proposional dan kulit yang sehat itu sangat ekonomis dengan DERMA EXPRESS<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>VISI<o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">Menjadikan seluruh pria dan wanita Indonesia berpenampilan menarik dengan harga yang ekonomis<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>MISI<o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">Mengedukasi masyarakat bahwa penampilan luar merupakan salah satu aspek penting dalam kehidupan modern serta memajukan dunia estetika medis di Indonesia<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>Technologi Kami<o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>Aptos Thread Lifting<o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">Aptos merupakan benang peremajaan Light Lift - benang yang terbuat dari bahan bioabsorbable yang sepenuhnya dihilangkan dari organisme dalam 360 hari.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>Meso Theraphy<o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">tujuannya adalah untuk membersihkan dan mengantioksidan, produk unik yang tidak dapat Anda temukan di rentang lain.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">&nbsp;<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>Laser Light Theraphy<o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">treatment dengan menggunakan sinar yang difilter untuk menghasilkan panjang gelombang tertentu dan menghasilkan warna-warna yang spesifik untuk mengatasi masalah kulit yang berbeda-beda, interaksi sinar disampaikan melalui Light Emitting Dioda (LED), menyebabkan bio-stimulasi pada sel kulit.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">Terapi Laser Light Therapy tidak mengandung UVA dan UVB yang dapat merusak kulit sehingga aman dan tanpa rasa sakit.</p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><br></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>KLINIK<o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">Jl. Utan Kayu no. 79B &amp; 79C<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">Gading Serpong<br>Ruko Diamond III No 12-15, Jalan Gading Golf Boulevard, Gading Serpong, Pakulonan Bar., Kec. Klp. Dua, Kota Tangerang, Banten 15810<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><b>Media Sosial<o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\">INSTAGRAM : @DERMA_EXPRESS TWITTER : @DERMA_EXPRESS<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif;\"><o:p>&nbsp;</o:p></p>', NULL, '2020-03-03 05:31:43', '2020-03-12 04:00:16'),
