(38, 23, 1, 'Tentang Kami', '<p style=\"text-align: justify; \"><span style=\"font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;Dairyciouse memperkenalkan produk terbaru Untuk pecinta Youghurt. Dengan berbagai rasa yang kami sediakan dan kualitas yang Terbaik demi menjaga agar Aman dan Lezat di tangan konsumen.Kami berusaha yang terbaik dalam memberikan pengalaman rasa yang baik agar komsumen kami puas dan Terima Kasih telah membeli produk kami</span></p>', NULL, '2021-05-31 01:52:25', '2021-07-10 06:16:05'),
(39, 23, 2, 'About us', '<p>Dairyciouse introduces a new product for Youghurt lovers. With a variety of flavors that we provide and the best quality in order to keep it safe and delicious in the hands of consumers.</p><p><br></p><p>We try our best to provide a good taste experience so that our customers are satisfied and Thank you for buying our product</p>', NULL, '2021-05-31 01:52:25', '2021-05-31 01:52:25'),
(40, 24, 1, 'Bagaimana Kami bekerja', '<p>&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"font-family: &quot;Times New Roman&quot;;\">Produk kami terbuat dari 100% susu murni yang diolah dengan Peralatan yang canggih. Sehingga produk kami dapat bertahan hingga berbulan - bulan pada suhu 0°-4° dan 4 jam pada suhu normal</span></p>', NULL, '2021-05-31 02:08:33', '2021-07-10 06:16:35'),
(41, 24, 2, 'How we work', '<p>Our products are made from 100% pure milk which is processed with sophisticated equipment. So our products can last up to months at 0 ° -4 ° and 4 hours at normal temperatures<br></p>', NULL, '2021-05-31 02:08:33', '2021-05-31 02:08:33'),
(42, 25, 1, 'Referensi', '<p style=\"text-align: justify; \">&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(42, 42, 42); font-family: Roboto, sans-serif; font-size: 14px; background-color: rgb(248, 248, 248);\">Janick, Jules, and Robert E. Paull. “Mangifera indica.” The Encyclopedia of Fruit &amp; Nuts. Wallingford: CABI, 2008. 15-19. Google Books. Web. 10 October 2020.</span></p>', NULL, '2021-05-31 02:12:14', '2021-07-10 06:17:34'),
(43, 25, 2, 'Reference', '<p><span style=\"color: rgb(42, 42, 42); font-family: Roboto, sans-serif; font-size: 14px; background-color: rgb(248, 248, 248);\">Janick, Jules, and Robert E. Paull. “Mangifera indica.” The Encyclopedia of Fruit &amp; Nuts. Wallingford: CABI, 2008. 15-19. Google Books. Web. 10 October 2020.</span><br></p>', NULL, '2021-05-31 02:12:14', '2021-05-31 02:12:14'),
(44, 26, 1, 'Hubungi Kami', '<p style=\"text-align: justify; \">&nbsp;&nbsp;&nbsp;&nbsp;Kami tersedia 24 jam untuk layanan contact silahkan hubungi 082xxxxxxxx</p>', NULL, '2021-05-31 02:14:41', '2021-07-10 06:18:05'),
(45, 26, 2, 'Contact Us', '<p>We are available 24 hours for contact services, please contact 082xxxxxxxx<br></p>', NULL, '2021-05-31 02:14:41', '2021-05-31 02:14:41');
