INSERT INTO `posting_language` (`id`, `seo`, `id_posting`, `id_language`, `judul`, `content`, `content_android`, `created_at`, `updated_at`) VALUES
(1, 'apakah-susu-penyebab-munculnya-jerawat', 1, '1', 'Apakah Susu Penyebab Munculnya Jerawat ?', '<h2 style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-size: 24px; line-height: 24px;\"><p style=\"font-size: 13px; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"EN-US\">Derma Express, Jakarta</span></b><span lang=\"EN-US\">&nbsp;– Susu dianggap sebagai produk yang memiliki segudang manfaat untuk tubuh tapi tahukah kamu bahwa ternyata susu dapat memicu munculnya jerawat lho. Mengkonsumsi susu seringkali dituduh sebagai penyebab jerawat.&nbsp;</span><span lang=\"EN-US\" style=\"font-family: Roboto, serif;\">Jika ingin mendapatkan wajah ter</span><span lang=\"EN-US\" style=\"font-family: Roboto, serif;\">bebas&nbsp; dari&nbsp;</span><span lang=\"EN-US\"><a href=\"https://www.pikiran-rakyat.com/tag/jerawat\"><span style=\"font-family: Roboto, serif; color: black;\">jerawat</span></a></span><span lang=\"EN-US\" style=\"font-family: Roboto, serif;\">, sebaiknya menjauhi produk&nbsp;<a href=\"https://www.pikiran-rakyat.com/tag/susu\"><span style=\"color: black;\">susu</span></a>&nbsp;apapun jenisnya.<o:p></o:p></span></p><p style=\"font-size: 13px; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\" style=\"font-family: Roboto, serif;\">Sebab terdapat hormon yang disebut IGF-1 hadir dalam&nbsp;<a href=\"https://www.pikiran-rakyat.com/tag/susu\"><span style=\"color: black;\">susu</span></a>&nbsp;yang tidak baik untuk tubuh manusia.&nbsp;</span><span lang=\"EN-US\">Kandungan lemak pada susu dapat mempengaruhi faktor hormon pada tubuh dan inflamasi (peradangan), yang keduanya menstimulasi produk sebum atau sekresi berminyak dari kelenjar sebaceous kulit, yang menjadi salah satu munculnya jerawat.</span><span lang=\"EN-US\" style=\"font-family: Roboto, serif;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"font-size: 13px; text-align: justify;\"><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 17.12px; font-family: &quot;Times New Roman&quot;, serif;\">Tak hanya susu, beberapa produk olahan susu lainnya, terkecuali yoghurt, juga bisa menyebabkan jerawat bagi sebagian orang. Kandungan probiotik yang ada pada&nbsp;<i>yoghurt</i>&nbsp;justru bisa memberikan efek positif bagi kesehatan kulit, khususnya dalam mengendalikan jerawat. Diduga, probiotik ini mampu meredakan peradangan pada kulit sehingga bisa mencegah datangnya masalah kesehatan kulit tersebut.<o:p></o:p></span></p><p style=\"font-size: 13px;\"></p><p class=\"MsoNormal\" style=\"font-size: 13px; text-align: justify;\"><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 17.12px; font-family: &quot;Times New Roman&quot;, serif;\">Jika kamu termasuk dalam orang yang mengalami jerawat setelah mengkonsumsi susu, ada baiknya kamu membatasi asupan minuman ini untuk menghindari datangnya jerawat. Jika kamu tidak masalah kulit ini meskipun kerap mengkonsumsinya, kamu bisa tetap rutin minum susu namun tetap harus menjaga kebersihan kulit, khususnya kulit wajah demi mencegah munculnya jerawat.</span><span lang=\"EN-US\" style=\"font-family: Arial, sans-serif; color: rgb(46, 46, 46);\"><br></span></p></h2><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:107%;\r\nfont-family:&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p>', NULL, '2020-12-22 04:07:17', '2021-07-07 02:09:49'),
(2, 'apakah-susu-penyebab-munculnya-jerawat', 1, '2', 'Apakah Susu Penyebab Munculnya Jerawat ?', '<p style=\"text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"EN-US\">Derma\r\nExpress, Jakarta</span></b><span lang=\"EN-US\"> – Susu dianggap sebagai produk yang memiliki segudang manfaat\r\nuntuk tubuh tapi tahukah kamu bahwa ternyata susu dapat memicu munculnya\r\njerawat lho. Mengkonsumsi susu seringkali dituduh sebagai penyebab jerawat. </span><span lang=\"EN-US\" style=\"font-family: Roboto, serif;\">Jika ingin\r\nmendapatkan wajah ter</span><span lang=\"EN-US\" style=\"font-family: Roboto, serif;\">bebas&nbsp; dari </span><span lang=\"EN-US\"><a href=\"https://www.pikiran-rakyat.com/tag/jerawat\"><span style=\"font-family: Roboto, serif; color: black;\">jerawat</span></a></span><span lang=\"EN-US\" style=\"font-family: Roboto, serif;\">, sebaiknya\r\nmenjauhi produk&nbsp;<a href=\"https://www.pikiran-rakyat.com/tag/susu\"><span style=\"color: black;\">susu</span></a>&nbsp;apapun jenisnya.<o:p></o:p></span></p><p style=\"text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\" style=\"font-family: Roboto, serif;\">Sebab terdapat\r\nhormon yang disebut IGF-1 hadir dalam&nbsp;<a href=\"https://www.pikiran-rakyat.com/tag/susu\"><span style=\"color: black;\">susu</span></a>&nbsp;yang\r\ntidak baik untuk tubuh manusia. </span><span lang=\"EN-US\">Kandungan lemak pada susu dapat mempengaruhi faktor hormon\r\npada tubuh dan inflamasi (peradangan), yang keduanya menstimulasi produk sebum\r\natau sekresi berminyak dari kelenjar sebaceous kulit, yang menjadi salah satu\r\nmunculnya jerawat.</span><span lang=\"EN-US\" style=\"font-family: Roboto, serif;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:107%;font-family:&quot;Times New Roman&quot;,serif\">Tak\r\nhanya susu, beberapa produk olahan susu lainnya, terkecuali yoghurt, juga bisa\r\nmenyebabkan jerawat bagi sebagian orang. Kandungan probiotik yang ada pada <i>yoghurt</i>\r\njustru bisa memberikan efek positif bagi kesehatan kulit, khususnya dalam\r\nmengendalikan jerawat. Diduga, probiotik ini mampu meredakan peradangan pada\r\nkulit sehingga bisa mencegah datangnya masalah kesehatan kulit tersebut. <o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:107%;font-family:&quot;Times New Roman&quot;,serif\">Jika\r\nkamu termasuk dalam orang yang mengalami jerawat setelah mengkonsumsi susu, ada\r\nbaiknya kamu membatasi asupan minuman ini untuk menghindari datangnya jerawat.\r\nJika kamu tidak masalah kulit ini meskipun kerap mengkonsumsinya, kamu bisa\r\ntetap rutin minum susu namun tetap harus menjaga kebersihan kulit, khususnya\r\nkulit wajah demi mencegah munculnya jerawat.</span><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;color:#2E2E2E\"><br>\r\n<!--[if !supportLineBreakNewLine]--><br>\r\n<!--[endif]--></span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:107%;\r\nfont-family:&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p>', NULL, '2020-12-22 04:07:17', '2020-12-22 04:07:17');
