(4, 'kamu-hoby-gowes-kenali-3-tips-untuk-menjaga-kulit-tetap-sehat', 2, '2', 'Kamu Hoby Gowes? Kenali 3 Tips Untuk Menjaga Kulit Tetap Sehat !', '<p class=\"MsoNormal\" style=\"text-align:left;line-height:115%\"><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%; font-family: &quot;Times New Roman&quot;, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Derma Express, Jakarta - Bukan rahasia lagi, bersepeda\r\nmenjadi olahraga yang kini dilakukan banyak orang di tengah pandemi Covid-19.\r\nTak memandang usia, kegiatan bersepeda bisa jadi salah satu olahraga sehat yang\r\ndilakukan semua kalangan. Meski dapat memberi efek menyehatkan tubuh, tetapi\r\nkamu tidak boleh mengabaikan kesehatan kulit wajah, lho. Terlebih untuk kamu\r\nyang hobi gowes hingga berjam-jam di bawah paparan sinar matahari dan polusi\r\nyang dapat menutup pori pori wajah kamu yang menyebabkan wajah kusam, komedo\r\ndan munculnya jerawat. Jangan halangi hoby kamu menghalangi wajah sehatmu ! Supaya\r\nkulit tetap sehat terjaga, yuk lakukan beberapa rutinitas berikut ini!</span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:115%\"><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%; font-family: &quot;Times New Roman&quot;, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:115%\"><b><span lang=\"NL\" style=\"font-size:14.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:NL\">Lindungi\r\nkulit dengan <i>Sunscreen,</i> dan lakukan <i>re-apply</i></span></b><span lang=\"NL\" style=\"font-size: 12pt; line-height: 115%; font-family: &quot;Times New Roman&quot;, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:115%\"><span lang=\"NL\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:NL\">Tantangan yang dihadapi perempuan saat bersepeda yakni\r\npaparan sinar matahari yang menyengat.<span style=\"color:#616161\"> </span></span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%; font-family: &quot;Times New Roman&quot;, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Meski terasa asyik untuk\r\nmenikmati hangatnya sinar mtahari dan semilir angin di atas sepeda, bukan berarti\r\nkamu bisa membiarkan kulit wajah tanpa perlindungan <i>sunscreen</i>. </span><i><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%; font-family: &quot;Times New Roman&quot;, serif; color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Sunscreen</span></i><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%; font-family: &quot;Times New Roman&quot;, serif; color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> bisa dibilang adalah senjata paling penting\r\ndan tidak biasa di skip untuk beraktivitas khususnya di luar ruangan apalagi\r\nuntuk bersepeda pasti hal yang sangat penting banget kan ?&nbsp; <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:115%\"><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%; font-family: &quot;Times New Roman&quot;, serif; color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Dengan menggunakan <i>sunscreen</i>, kulit wajah kamu akan mendapatkan perlindungan dari\r\npaparan sinar matahari saat bersepeda. Pilihlah <i>sunscreen</i> dengan SPF yang tinggi sebelum kamu mulai bersepedah ya! </span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%; font-family: &quot;Times New Roman&quot;, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Selain itu, pastikan\r\nuntuk selalu melakukan <i>re-apply&nbsp;<em>sunscreen&nbsp;</em></i>setidaknya\r\nsetiap 2 jam sekali. Untuk sesi <i>re-apply</i></span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%; font-family: &quot;Times New Roman&quot;, serif; color: rgb(112, 112, 112); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> </span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">perhatikan\r\njuga bagaimana jenis kulit kamu, jika memiliki kulit dengan tipe yang cenderung\r\nberminyak dan berjerawat, <i><span style=\"color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">sunscreen</span></i> basis gel atau\r\nspray akan lebih cocok kamu gunakan.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoTitle\" style=\"text-align:justify;line-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:14.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif\">Segera&nbsp; <i>double\r\ncleansing </i>setelah bersepeda<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"line-height:115%\"><!--[if gte vml 1]><v:shapetype\r\n id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\"\r\n path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n <v:stroke joinstyle=\"miter\"/>\r\n <v:formulas>\r\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\"/>\r\n  <v:f eqn=\"sum @0 1 0\"/>\r\n  <v:f eqn=\"sum 0 0 @1\"/>\r\n  <v:f eqn=\"prod @2 1 2\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelWidth\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelHeight\"/>\r\n  <v:f eqn=\"sum @0 0 1\"/>\r\n  <v:f eqn=\"prod @6 1 2\"/>\r\n  <v:f eqn=\"prod @7 21600 pixelWidth\"/>\r\n  <v:f eqn=\"sum @8 21600 0\"/>\r\n  <v:f eqn=\"prod @7 21600 pixelHeight\"/>\r\n  <v:f eqn=\"sum @10 21600 0\"/>\r\n </v:formulas>\r\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\"/>\r\n <o:lock v:ext=\"edit\" aspectratio=\"t\"/>\r\n</v:shapetype><v:shape id=\"Picture_x0020_5\" o:spid=\"_x0000_s1026\" type=\"#_x0000_t75\"\r\n style=\'position:absolute;margin-left:0;margin-top:270.5pt;width:297pt;\r\n height:202.5pt;z-index:251658240;visibility:visible;mso-wrap-style:square;\r\n mso-wrap-distance-left:9pt;mso-wrap-distance-top:0;mso-wrap-distance-right:9pt;\r\n mso-wrap-distance-bottom:0;mso-position-horizontal:left;\r\n mso-position-horizontal-relative:margin;mso-position-vertical:absolute;\r\n mso-position-vertical-relative:margin\'>\r\n <v:imagedata src=\"file:///C:/Users/BARACO~1/AppData/Local/Temp/msohtmlclip1/01/clip_image001.jpg\"\r\n  o:title=\"\"/>\r\n <w:wrap type=\"square\" anchorx=\"margin\" anchory=\"margin\"/>\r\n</v:shape><![endif]--><!--[if !vml]--><!--[endif]--><span lang=\"EN-US\" style=\"font-family:&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height:115%\"><span lang=\"EN-US\" style=\"font-family:\r\n&quot;Times New Roman&quot;,serif\"><o:p>&nbsp;</o:p></span><img src=\"data:image/jpeg;base64,\" data-filename=\"double screening.jpg\" style=\"width: 50%;\"></p><p class=\"MsoNormal\" style=\"line-height:115%\"><span lang=\"EN-US\" style=\"font-family:\r\n&quot;Times New Roman&quot;,serif\">Wajib banget <i>double\r\ncleansing </i>setelah bersepeda <span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">karena\r\n</span><span style=\"color: rgb(33, 37, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Polusi yang debu yang\r\nmenempel di wajah lama kelamaan akan menimbulkan berbagai macam masalah kulit\r\ndikarenakan tersumbatnya pori-pori, seperti jerawat, komedo bahkan bintik\r\nhitam. Setelah melakukan <i>double cleansing\r\n</i>step selanjutnya adalah dengan mencuci muka dengan facial wash yang sesuai\r\ndengan jenis kulit kamu ya.</span></span></p><h3 style=\"margin: 0cm 0cm 7.5pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\" style=\"font-size:14.0pt;\r\nline-height:115%;color:#151515;mso-bidi-font-weight:normal\">Rawat kulit wajah\r\ndengan <i>skincare </i>yang tepat<o:p></o:p></span></h3><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"line-height:115%\"><span lang=\"EN-US\" style=\"font-family: &quot;Times New Roman&quot;, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Sering menghabiskan waktu\r\ndi luar ruangan, secara tidak langsung membuat kulit terpapar debu dan kotoran\r\nserta keringat yang keluar saat Anda bersepeda. Agar kondisi kulit tetap terjaga\r\nkelembabanya, pastikan menggunkan <i>skincare\r\n</i>yang tepat dan sesuai dengan jenis kulit kamu. tentunya juga rutin\r\nmelakukan eksfoliasi untuk mengangkat sel kulit mati dan menggunakan sheet mask\r\nyang kaya kandungan pelembap. Penggunaan sheet mask tidak hanya menghidrasi\r\nkulit, tapi juga bisa memberi efek relaksasi di wajah.<o:p></o:p></span></p>', NULL, '2020-12-22 04:10:26', '2020-12-22 04:10:26');
INSERT INTO `posting_language` (`id`, `seo`, `id_posting`, `id_language`, `judul`, `content`, `content_android`, `created_at`, `updated_at`) VALUES
(5, 'katanya-minum-kopi-bikin-wajah-berjerawat', 3, '1', 'Katanya Minum Kopi Bikin Wajah Berjerawat ?', '<p class=\"MsoNormal\" style=\"text-align:justify\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:107%;font-family:\r\n&quot;Times New Roman&quot;,serif\">Derma Express, Jakarta- </span></b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:107%;font-family:&quot;Times New Roman&quot;,serif\">P<span style=\"color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">ola makan bisa jadi penyebab timbulnya\r\njerawat di wajah. Tapi benarkah mengonsumsi kopi juga bisa memicu jerawat?</span><span style=\"color:#333333\"> <span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Semua orang pastinya\r\ningin memiliki kulit yang bersih dan mulus tanpa jerawat. <o:p></o:p></span></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 107%; font-family: &quot;Times New Roman&quot;, serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Tapi kadang jerawat membandel ini selalu muncul\r\ndan mengganggu penampilan.</span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nline-height:107%;font-family:&quot;Times New Roman&quot;,serif;color:#333333\"> <span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Penyebab timbulnya jerawat sangat banyak salah satunya\r\npolusi dan asupan makanan yang masuk ke dalam tubuh. Kalau segala jenis\r\nperawatan sudah dicoba namun tak berhasil, tandanya kamu harus lebih\r\nmemperhatikan pola makan. Beberapa makanan yang memicu timbulnya jerawat antara\r\nlain makanan pedas, produk susu, roti dan gorengan. Tapi yang mengejutkan,\r\nkabarnya kopi juga jadi salah satu pemicu hadirnya jerawat.<o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 107%; font-family: &quot;Times New Roman&quot;, serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Jerawat bisa semakin memburuk karena asupan\r\nkopi yang berlebihan, namun bukan penyebab utamanya. Pasalnya jerawat dipicu\r\noleh ketidakseimbangan hormon. Kamu harus menghindari makanan mengandung banyak\r\ngula.<o:p></o:p></span></p><p style=\"margin: 0cm 0cm 7.5pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"DE\" style=\"color:#434343;\r\nmso-ansi-language:DE\">Seperti yang kita ketahui bahwa kopi merupakan jenis minuman\r\nyang mengandung kafein. Zat inilah yang membuat kamu selalu merasa waspada dan\r\nterjaga, namun di sisi lain akan meningkatkan stres di dalam tubuh. Bahkan\r\nsecangkir besar kopi bisa meningkatkan dua kali lipat kadar stres di dalam\r\ntubuh. Stres tidak menyebabkan jerawat, tetapi akan memperburuk jerawat yang\r\nada. Hormon stres seperti kortisol dapat meningkatkan jumlah minyak yang\r\ndiproduksi oleh kelenjar sebaceous<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p style=\"margin: 0cm 0cm 7.5pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\" style=\"color:#434343\">Efek\r\nkafein juga dapat menghancurkan jadwal tidur kamu. Akibatnya, akan berujung\r\npada kurang tidur yang dapat menimbulkan lebih banyak stress dan memperburuk\r\njerawat kamu.<o:p></o:p></span></p>', NULL, '2020-12-22 04:12:52', '2020-12-22 04:12:52'),
(6, 'katanya-minum-kopi-bikin-wajah-berjerawat', 3, '2', 'Katanya Minum Kopi Bikin Wajah Berjerawat ?', '<p class=\"MsoNormal\" style=\"text-align:justify\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:107%;font-family:\r\n&quot;Times New Roman&quot;,serif\">Derma Express, Jakarta- </span></b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:107%;font-family:&quot;Times New Roman&quot;,serif\">P<span style=\"color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">ola makan bisa jadi penyebab timbulnya\r\njerawat di wajah. Tapi benarkah mengonsumsi kopi juga bisa memicu jerawat?</span><span style=\"color:#333333\"> <span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Semua orang pastinya\r\ningin memiliki kulit yang bersih dan mulus tanpa jerawat. <o:p></o:p></span></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 107%; font-family: &quot;Times New Roman&quot;, serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Tapi kadang jerawat membandel ini selalu muncul\r\ndan mengganggu penampilan.</span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nline-height:107%;font-family:&quot;Times New Roman&quot;,serif;color:#333333\"> <span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Penyebab timbulnya jerawat sangat banyak salah satunya\r\npolusi dan asupan makanan yang masuk ke dalam tubuh. Kalau segala jenis\r\nperawatan sudah dicoba namun tak berhasil, tandanya kamu harus lebih\r\nmemperhatikan pola makan. Beberapa makanan yang memicu timbulnya jerawat antara\r\nlain makanan pedas, produk susu, roti dan gorengan. Tapi yang mengejutkan,\r\nkabarnya kopi juga jadi salah satu pemicu hadirnya jerawat.<o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 107%; font-family: &quot;Times New Roman&quot;, serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Jerawat bisa semakin memburuk karena asupan\r\nkopi yang berlebihan, namun bukan penyebab utamanya. Pasalnya jerawat dipicu\r\noleh ketidakseimbangan hormon. Kamu harus menghindari makanan mengandung banyak\r\ngula.<o:p></o:p></span></p><p style=\"margin: 0cm 0cm 7.5pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"DE\" style=\"color:#434343;\r\nmso-ansi-language:DE\">Seperti yang kita ketahui bahwa kopi merupakan jenis minuman\r\nyang mengandung kafein. Zat inilah yang membuat kamu selalu merasa waspada dan\r\nterjaga, namun di sisi lain akan meningkatkan stres di dalam tubuh. Bahkan\r\nsecangkir besar kopi bisa meningkatkan dua kali lipat kadar stres di dalam\r\ntubuh. Stres tidak menyebabkan jerawat, tetapi akan memperburuk jerawat yang\r\nada. Hormon stres seperti kortisol dapat meningkatkan jumlah minyak yang\r\ndiproduksi oleh kelenjar sebaceous<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p style=\"margin: 0cm 0cm 7.5pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\" style=\"color:#434343\">Efek\r\nkafein juga dapat menghancurkan jadwal tidur kamu. Akibatnya, akan berujung\r\npada kurang tidur yang dapat menimbulkan lebih banyak stress dan memperburuk\r\njerawat kamu.<o:p></o:p></span></p>', NULL, '2020-12-22 04:12:52', '2020-12-22 04:12:52'),
(7, 'make-up-tidak-membantu-zoom-meeting-mengapa-tidak-mempertimbangkan-perawatan-wajah', 4, '1', 'Make Up Tidak Membantu \'Zoom Meeting\' ? Mengapa tidak mempertimbangkan perawatan wajah.', '<p style=\"margin: 15pt 0cm; margin-inline: 5px; text-align: justify; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"EN-US\">Derma\r\nExpress, Jakarta-</span></b><span lang=\"EN-US\"> Di masa pandemi Covid-19 <i>zoom</i> <i>meeting </i>menjadi salah satu\r\nyang popular untuk <i>work from home</i>. Itu artinya kita tetap harus menjalankan\r\nbeberapa pekerjaan kita di rumah dan aktivitas virtual meeting menjadi tidak\r\nterhindarkan.<o:p></o:p></span></p><p style=\"margin: 15pt 0cm; text-align: justify; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\">Zoom meeting memang menjadi sebuah\r\nkebiasaan baru setelah masa pandemi ini. Pakaian dan riasan menjadi pelengkap\r\ndalam menjalani aktifitasmu sepanjang hari, mulai dari menerima panggilan\r\nclient, mengerjakan perintah bos hingga mendengarkan pengumuman besar.<o:p></o:p></span></p><p style=\"margin: 15pt 0cm; text-align: justify; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\">Seperti yang kita ketahui penampilan\r\nyang nyaman akan membuat seseorang lebih percaya diri. Oleh karena itu\r\nrutinitas kecantikan dapat menjadi cara kreatif dan menyenangkan untuk\r\nmengekspresikan diri dan membangkitkan <i>mood </i>di masa sulit sekalipun.<o:p></o:p></span></p><p style=\"margin: 15pt 0cm; text-align: justify; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\">Menggunakan make-up salah satu hal\r\nyang penting saat <i>zoom meeting</i> untuk menunjang penampilan, tetapi dari\r\nbeberapa wanita banyak mengeluhkan karena harus 10 – 15 menit untuk make\r\nwalaupun natural. Hal itu yang membuat banyak wanita ingin melakukan perawatan\r\nagar wajah menjadi <i>glowing </i>dan sehat tanpa harus menggunakan make-up.<o:p></o:p></span></p><p style=\"margin: 15pt 0cm; text-align: justify; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\">Perawatan bisa dilakukan sendiri di\r\nrumah dan di klinik kecantikan untuk hasil yang lebih maksimal. Perawatan di\r\nrumah yang kamu bisa lakukan dengan masker wajah,scrub, dll. Sedangkan di\r\nklinik kecantikan akan disesuaikan dengan jenis kulit wajah dan permasalahan\r\nyang di butuhkan setiap masing – masing. Kebanyakan perempuan yang melakukan perawatan\r\ndi klinik kecantikan baik <i>facial</i>, dan perawatan kecantikan lainya untuk\r\nwajah menjadi <i>glowing</i>. <o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p style=\"margin: 15pt 0cm; text-align: justify; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\">Derma express hadir untuk membantu\r\npermasalahan kalian, yang ingin memiliki wajah sehat dan <i>glowing</i> kamu\r\nbisa dengan perawatan favorite dari Derma Express yaitu DNA Salmon yang <span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">terbukti membantu merangsang kolagen, sehingga kulit\r\nakan lebih bersinar, lembab dan flek memudar setelah perawatan.</span><o:p></o:p></span></p>', NULL, '2020-12-22 04:34:26', '2020-12-22 04:34:26'),
