(9, 'derma-express-hadir-di-tiga-lokasi', 5, '1', 'Derma Express Hadir di Tiga Lokasi', '<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: medium; line-height: 22px; font-family: Roboto, HelveticaNeueW01-45Light, Helvetica, Arial; vertical-align: baseline; letter-spacing: 0.16px; text-rendering: optimizespeed; -webkit-font-smoothing: antialiased; color: rgb(51, 51, 51);\"><em style=\"font-family: inherit; font-size: inherit; letter-spacing: 0.16px; font-weight: inherit; margin: 0px 2px 0px 0px; padding: 0px; border: 0px; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;\">Antusiasme masyarakat mendorong derma express mengembangkan sayap lebih jauh lagi.</em><br></p><p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: medium; line-height: 22px; font-family: Roboto, HelveticaNeueW01-45Light, Helvetica, Arial; vertical-align: baseline; letter-spacing: 0.16px; text-rendering: optimizespeed; -webkit-font-smoothing: antialiased; color: rgb(51, 51, 51);\"><span style=\"letter-spacing: 0.16px;\"><i>D</i>engan kehadiran Derma Express memotivasinya untuk melebarkan sayap lebih jauh lagi. Saat ini Derma Express telah tersedia di tiga lokasi yang tersebar di Jabodetabek yaitu Utan Kayu, Serpong, Tangerang dan Tawakal, Jakarta Barat.</span></p><p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: medium; line-height: 22px; font-family: Roboto, HelveticaNeueW01-45Light, Helvetica, Arial; vertical-align: baseline; letter-spacing: 0.16px; text-rendering: optimizespeed; -webkit-font-smoothing: antialiased; color: rgb(51, 51, 51);\">\"Hadirnya Derma Express Tawakal dikarenakan di Jakarta, penampilan fisik sudah menjadi kebutuhan utama, karena tidak dapat dipungkiri lagi hal tersebut sangat berpengaruh ke karir dan kehidupan personal. Derma Express tetap pada komitmen kami yaitu menyediakan treatment aman dan terjangkau bagi masyarakat\" ujar Stiven Eli selaku Head Docter Derma Express</p><p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: medium; line-height: 22px; font-family: Roboto, HelveticaNeueW01-45Light, Helvetica, Arial; vertical-align: baseline; letter-spacing: 0.16px; text-rendering: optimizespeed; -webkit-font-smoothing: antialiased; color: rgb(51, 51, 51);\">Derma Express menghadirkan beberapa treatment terbaru yaitu&nbsp;<em style=\"margin: 0px 2px 0px 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Glow Booster</em>,<em style=\"margin: 0px 2px 0px 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">&nbsp;Sexy Back, Spot Free,</em>&nbsp;dan Vita Glow yang ditujukan untuk mereka yang ingin mendapatkan kulit yang lebih sehat dan cantik.</p><p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: medium; line-height: 22px; font-family: Roboto, HelveticaNeueW01-45Light, Helvetica, Arial; vertical-align: baseline; letter-spacing: 0.16px; text-rendering: optimizespeed; -webkit-font-smoothing: antialiased; color: rgb(51, 51, 51);\"><em style=\"margin: 0px 2px 0px 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Glow Booster</em>&nbsp;bermanfaat agar kulit lebih kenyal, lembab cerah dan&nbsp;<em style=\"margin: 0px 2px 0px 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">glowing</em>. Selain itu&nbsp;<em style=\"margin: 0px 2px 0px 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Glow Booster&nbsp;</em>juga mampu mengatasi masalah kulit wajah lainnya seperti, flek, bekas jerawat yang merah, dan\"sunburn.\"</p><p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: medium; line-height: 22px; font-family: Roboto, HelveticaNeueW01-45Light, Helvetica, Arial; vertical-align: baseline; letter-spacing: 0.16px; text-rendering: optimizespeed; -webkit-font-smoothing: antialiased; color: rgb(51, 51, 51);\"><em style=\"margin: 0px 2px 0px 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Sexy Back Treatment&nbsp;</em>berfungsi mengatasi peradangan dan menghilangkan jerawat pada area punggung yang seringkali sulit diobati. Hasilnya, kulit punggung lebih halus dan sehat terawat. Berikutnya,&nbsp;<em style=\"margin: 0px 2px 0px 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Spot Free Treatment</em>&nbsp;berfungsi menghilangkan bekas luka dan bekas gigitan nyamuk yang menghitam. Selain itu,&nbsp;<em style=\"margin: 0px 2px 0px 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Spot Free Treatment</em>&nbsp;juga mampu menyamarkan strecthmark dan mencerahkan warna kulit.</p><p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: medium; line-height: 22px; font-family: Roboto, HelveticaNeueW01-45Light, Helvetica, Arial; vertical-align: baseline; letter-spacing: 0.16px; text-rendering: optimizespeed; -webkit-font-smoothing: antialiased; color: rgb(51, 51, 51);\"><em style=\"margin: 0px 2px 0px 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Sedangkan Supervit Infusion&nbsp;</em>berfungsi meningkatkan dan menjaga daya tahan tubuh agar tidak mudah sakit dan terkena virus. Selain meningkatkan kekebalan tubuh, Supervit Infusion juga mampu menstimulasi produksi kolagen pada tubuh dan membuat kulit terlihat lebih cerah berseri.</p><p></p><p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: medium; line-height: 22px; font-family: Roboto, HelveticaNeueW01-45Light, Helvetica, Arial; vertical-align: baseline; letter-spacing: 0.16px; text-rendering: optimizespeed; -webkit-font-smoothing: antialiased; color: rgb(51, 51, 51);\"></p><p></p><p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 400; font-stretch: inherit; font-size: medium; line-height: 22px; font-family: Roboto, HelveticaNeueW01-45Light, Helvetica, Arial; vertical-align: baseline; letter-spacing: 0.16px; text-rendering: optimizespeed; -webkit-font-smoothing: antialiased; color: rgb(51, 51, 51); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Derma Express akan terus melebarkan sayapnya ke seluruh penghujung Indonesia untuk menjawab kebutuhan masyarakat agar dapat memperoleh wajah sehat dan proporsional, dan kesehatan kulit yang maksimal.</p><p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: medium; line-height: 22px; font-family: Roboto, HelveticaNeueW01-45Light, Helvetica, Arial; vertical-align: baseline; letter-spacing: 0.16px; text-rendering: optimizespeed; -webkit-font-smoothing: antialiased; color: rgb(51, 51, 51);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">dikutip dari:</span></p><p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: medium; line-height: 22px; font-family: Roboto, HelveticaNeueW01-45Light, Helvetica, Arial; vertical-align: baseline; letter-spacing: 0.16px; text-rendering: optimizespeed; -webkit-font-smoothing: antialiased; color: rgb(51, 51, 51);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">(</span><a href=\"https://inforial.tempo.co/info/1004119/derma-express-hadir-di-tiga-lokasi\" target=\"_blank\">https://inforial.tempo.co/info/1004119/derma-express-hadir-di-tiga-lokasi</a>)</p>', NULL, '2021-01-11 01:07:35', '2021-01-12 03:05:34'),
