 dan&nbsp;<em style=\"margin: 0px 2px 0px 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">glowing</em>. Selain itu&nbsp;<em style=\"margin: 0px 2px 0px 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Glow Booster&nbsp;</em>juga mampu mengatasi masalah kulit wajah lainnya seperti, flek, bekas jerawat yang merah, dan\"sunburn.\"</p><p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: medium; line-height: 22px; font-family: Roboto, HelveticaNeueW01-45Light, Helvetica, Arial; vertical-align: baseline; letter-spacing: 0.16px; text-rendering: optimizespeed; -webkit-font-smoothing: antialiased; color: rgb(51, 51, 51);\"><em style=\"margin: 0px 2px 0px 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Sexy Back Treatment&nbsp;</em>berfungsi mengatasi peradangan dan menghilangkan jerawat pada area punggung yang seringkali sulit diobati. Hasilnya, kulit punggung lebih halus dan sehat terawat. Berikutnya,&nbsp;<em style=\"margin: 0px 2px 0px 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Spot Free Treatment</em>&nbsp;berfungsi menghilangkan bekas luka dan bekas gigitan nyamuk yang menghitam. Selain itu,&nbsp;<em style=\"margin: 0px 2px 0px 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Spot Free Treatment</em>&nbsp;juga mampu menyamarkan strecthmark dan mencerahkan warna kulit.</p><p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: medium; line-height: 22px; font-family: Roboto, HelveticaNeueW01-45Light, Helvetica, Arial; vertical-align: baseline; letter-spacing: 0.16px; text-rendering: optimizespeed; -webkit-font-smoothing: antialiased; color: rgb(51, 51, 51);\"><em style=\"margin: 0px 2px 0px 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Sedangkan Supervit Infusion&nbsp;</em>berfungsi meningkatkan dan menjaga daya tahan tubuh agar tidak mudah sakit dan terkena virus. Selain meningkatkan kekebalan tubuh, Supervit Infusion juga mampu menstimulasi produksi kolagen pada tubuh dan membuat kulit terlihat lebih cerah berseri.</p><p></p><p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: medium; line-height: 22px; font-family: Roboto, HelveticaNeueW01-45Light, Helvetica, Arial; vertical-align: baseline; letter-spacing: 0.16px; text-rendering: optimizespeed; -webkit-font-smoothing: antialiased; color: rgb(51, 51, 51);\"></p><p></p><p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 400; font-stretch: inherit; font-size: medium; line-height: 22px; font-family: Roboto, HelveticaNeueW01-45Light, Helvetica, Arial; vertical-align: baseline; letter-spacing: 0.16px; text-rendering: optimizespeed; -webkit-font-smoothing: antialiased; color: rgb(51, 51, 51); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Derma Express akan terus melebarkan sayapnya ke seluruh penghujung Indonesia untuk menjawab kebutuhan masyarakat agar dapat memperoleh wajah sehat dan proporsional, dan kesehatan kulit yang maksimal.</p><p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: medium; line-height: 22px; font-family: Roboto, HelveticaNeueW01-45Light, Helvetica, Arial; vertical-align: baseline; letter-spacing: 0.16px; text-rendering: optimizespeed; -webkit-font-smoothing: antialiased; color: rgb(51, 51, 51);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">dikutip dari:</span></p><p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: medium; line-height: 22px; font-family: Roboto, HelveticaNeueW01-45Light, Helvetica, Arial; vertical-align: baseline; letter-spacing: 0.16px; text-rendering: optimizespeed; -webkit-font-smoothing: antialiased; color: rgb(51, 51, 51);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">(</span><a href=\"https://inforial.tempo.co/info/1004119/derma-express-hadir-di-tiga-lokasi\" target=\"_blank\">https://inforial.tempo.co/info/1004119/derma-express-hadir-di-tiga-lokasi</a>)</p>', NULL, '2021-01-11 01:07:35', '2021-01-12 03:05:34'),
(11, 'derma-express-memperkuat-ekspansi-bisnis-di-jabodetabek', 6, '1', 'Derma Express Memperkuat Ekspansi Bisnis di Jabodetabek', '<p><span style=\"color: rgb(33, 37, 41); font-family: &quot;Times New Roman&quot;; font-size: medium;\">Antusiasme besar yang ditunjukan oleh masyarakat dengan kehadiran Derma Express, memotivasi Derma Express untuk melebarkan sayap lebih jauh lagi.&nbsp;</span><span style=\"color: rgb(33, 37, 41); font-family: &quot;Times New Roman&quot;; font-size: medium;\">Saat ini Derma Express telah tersedia di 3 lokasi yang tersebar di Jabodetabek yaitu Cabang Utan Kayu, Cabang Serpong, dan yang terakhir adalah Cabang Tawakal, yang terletak di Jl. Tawakal Ujung C-1, Grogol Petamburan, Jakarta Barat. “Hadirnya Derma Express Tawakal dikarenakan di jakarta, penampilan fisik sudah menjadi kebutuhan utama, karena tidak dapat dipungkiri lagi hal tersebut sangat berpengaruh ke karir dan kehidupan personal.</span></p><p><span style=\"color: rgb(33, 37, 41); font-family: &quot;Times New Roman&quot;; font-size: medium;\"> Derma Express tetap pada komitmen kami yaitu untuk menyediakan treatment aman dan terjangkau bagi masyarakat,” ungkap Dokter Stiven Eli selaku Head Docter Derma Express dalam keterangan tertulisnya Rabu (2/12). Dalam kesempatan ini pun Derma Express menghadirkan beberapa treatment terbaru yaitu Glow Booster, Sexy Back, Spot Free, dan Vita Glow, treatment baru ini ditujukan untuk mereka yang ingin mendapatkan kulit yang lebih sehat dan cantik.&nbsp; Glow Booster, treatment ini bermanfaat agar kulit lebih kenyal, lembab cerah dan glowing. Selain itu Glow Booster juga mampu mengatasi masalah kulit wajah lainnya seperti, flek, bekas jerawat yang merah, serta sunburn.&nbsp; Selanjutnya adalah Sexy Back Treatment yang berfungsi mengatasi peradangan dan menghilangkan jerawat pada area punggung yang seringkali sulit untuk di obati. Hasilnya, kulit punggung jadi lebih halus dan sehat terawat. Selain itu, Spot Free Treatment berfungsi menghilangkan bekas luka dan bekas gigitan nyamuk yang menghitam.</span></p><p><span style=\"color: rgb(33, 37, 41); font-family: &quot;Times New Roman&quot;; font-size: medium;\"> Selain itu, Spot Free Treatment juga mampu menyamarkan strecthmark serta mencerahkan warna kulit. Dan yang terakhir adalah Supervit Infusion berfungsi untuk meningkatkan dan menjaga daya tahan tubuh agar tidak mudah sakit dan terkena virus. Selain meningkatkan kekebalan tubuh, Supervit Infusion juga mampu menstimulasi produksi kolagen pada tubuh, membuat kulit terlihat lebih cerah berseri. Derma Express akan terus melebarkan sayapnya ke seluruh penghujung Indonesia untuk menjawab kebutuhan masyarakat agar dapat memperoleh&nbsp; wajah sehat dan proporsional, dan juga kesehatan kulit yang maksimal.</span><br style=\"color: rgb(33, 37, 41); font-family: &quot;Times New Roman&quot;; font-size: medium;\"></p><p>dikutif dari&nbsp;<span style=\"color: rgb(33, 37, 41); font-family: &quot;Times New Roman&quot;; font-size: medium;\">JAKARTA, investor.id (</span><a href=\"https://investor.id/lifestyle/derma-express-memperkuat-ekspansi-bisnis-di-jabodetabek\" target=\"_blank\">https://investor.id/lifestyle/derma-express-memperkuat-ekspansi-bisnis-di-jabodetabek</a><span style=\"color: rgb(33, 37, 41); font-family: &quot;Times New Roman&quot;; font-size: medium;\">)</span></p>', NULL, '2021-01-20 23:37:51', '2021-01-21 00:03:53'),
