(19, 'perkuat-lini-bisnis-derma-express-buka-cabang-baru', 10, '1', 'Perkuat Lini Bisnis, Derma Express Buka Cabang Baru', '<p><span style=\"font-family: sans-serif; font-size: medium;\">INDUSTRI kecantikan, perawatan kulit, dan wajah di Indonesia masih menunjukkan gairah yang tinggi. Untuk makin menjangkau masyarakat dan menyambut ekosistem tersebut, klinik perawatan kulit, Derma Express memperkuat lini bisnisnya dengan membuka cabang baru di wilayah Jakarta Barat.Lewat cabang baru itu, Derma Express kini telah memiliki 3 lokasi klinik di Jabodetabek, yaitu di Utan Kayu, Serpong, dan cabang tawakal di Jakarta Barat.</span></p><p><span style=\"font-family: sans-serif; font-size: medium;\">“Hadirnya Derma Express Tawakal dikarenakan di jakarta, penampilan fisik sudah menjadi kebutuhan utama, karena tidak dapat dipungkiri lagi hal tersebut sangat berpengaruh ke karir dan kehidupan personal. Derma Express tetap pada komitmen kami yaitu untuk menyediakan treatment aman dan terjangkau bagi masyarakat” ungkap Stiven Eli, Head Docter Derma Express dalam keterangan tertulisnya.Stiven menambahkan, Derma Express akan terus melebarkan sayapnya ke seluruh Indonesia untuk menjawab kebutuhan masyarakat agar dapat memperoleh&nbsp; wajah sehat dan proporsional, dan juga kesehatan kulit yang maksimal.</span><br style=\"font-family: sans-serif; font-size: medium;\"></p><p><span style=\"font-family: sans-serif; font-size: medium;\">Di sisi lain, Derma Express menghadirkan beberapa treatment terbaru yaitu Glow Booster, Sexy Back, Spot Free, dan Vita Glow, treatment baru itu ditujukan untuk mereka yang ingin mendapatkan kulit yang lebih sehat dan cantik.&nbsp;</span></p><p><span style=\"font-family: sans-serif; font-size: medium;\">Stiven menjelaskan, Glow Booste bermanfaat agar kulit lebih kenyal, lembab cerah dan glowing. Selain itu Glow Booster juga mampu mengatasi masalah kulit wajah lainnya seperti, flek, bekas jerawat yang merah, serta sunburn.&nbsp;Sexy Back Treatment yang berfungsi mengatasi peradangan dan menghilangkan jerawat pada area punggung yang seringkali sulit untuk di obati. Hasilnya, kulit punggung jadi lebih halus dan sehat terawat.</span></p><p><span style=\"font-family: sans-serif; font-size: medium;\">Selain itu, Spot Free Treatment berfungsi menghilangkan bekas luka dan bekas gigitan nyamuk yang menghitam. Selain itu, Spot Free Treatment juga mampu menyamarkan strecthmark serta mencerahkan warna kulit.</span></p><p><span style=\"font-family: sans-serif; font-size: medium;\">\"Dan yang terakhir adalah Supervit Infusion berfungsi untuk meningkatkan dan menjaga daya tahan tubuh agar tidak mudah sakit dan terkena virus. Selain meningkatkan kekebalan tubuh, Supervit Infusion juga mampu menstimulasi produksi kolagen pada tubuh, membuat kulit terlihat lebih cerah berseri,\" pungkas Stiven.</span><br style=\"font-family: sans-serif; font-size: medium;\"><br style=\"font-family: sans-serif; font-size: medium;\"><span style=\"font-family: sans-serif; font-size: medium;\">Sumber:&nbsp;</span><a href=\"https://m.mediaindonesia.com/ekonomi/365901/perkuat-lini-bisnis-derma-express-buka-cabang-baru\" style=\"font-family: sans-serif; font-size: medium;\">https://m.mediaindonesia.com/ekonomi/365901/perkuat-lini-bisnis-derma-express-buka-cabang-baru</a><br></p>', NULL, '2021-01-21 00:32:49', '2021-01-21 00:32:49'),
