(31, 'gunakan-manfaat-penting-dari-pemasaran-di-sosial-media', 16, '1', 'Gunakan Manfaat Penting dari Pemasaran di Sosial Media', '<span style=\"color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">Saat kamu memulai menjadi reseller, kamu harus kuat dalam hal pemasaran. Hanya jika ada produk terjual, kamu dapat keuntungan. Jadi pastikan untuk melakukan pemasaran dengan giat. Pasarkan produk menggunakan sosial media yang menjadi marketplace terbaik saat ini.</span>', NULL, '2021-05-30 23:04:48', '2021-05-31 04:13:31'),
(32, 'gunakan-manfaat-penting-dari-pemasaran-di-sosial-media', 16, '2', 'Gunakan Manfaat Penting dari Pemasaran di Sosial Media', '<p><span style=\"color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">Saat kamu memulai menjadi reseller, kamu harus kuat dalam hal pemasaran. Hanya jika ada produk terjual, kamu dapat keuntungan. Jadi pastikan untuk melakukan pemasaran dengan giat. Pasarkan produk menggunakan sosial media yang menjadi marketplace terbaik saat ini.</span><br></p>', NULL, '2021-05-30 23:04:48', '2021-05-30 23:05:20'),
(33, 'perhitungkan-harga-jual-yang-bersaing', 17, '1', 'Perhitungkan Harga Jual yang Bersaing', '<span style=\"font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34);\">Saat kamu menjadi reseller, kamu perlu memiliki kemampuan perhitungan yang baik. Hal ini disebabkan kamu harus menghitung dengan benar berapa selisih harga beli dan harga jual, dikurangi biaya lain seperti transfer. Jadi kamu tetap mendapatkan keuntungan walau dengan harga jual yang bersaing.</span>', NULL, '2021-05-30 23:06:38', '2021-05-31 04:16:14'),
(34, 'perhitungkan-harga-jual-yang-bersaing', 17, '2', 'Perhitungkan Harga Jual yang Bersaing', '<p style=\"font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34);\">Saat kamu menjadi reseller, kamu perlu memiliki kemampuan perhitungan yang baik. Hal ini disebabkan kamu harus menghitung dengan benar berapa selisih harga beli dan harga jual, dikurangi biaya lain seperti transfer. Jadi kamu tetap mendapatkan keuntungan walau dengan harga jual yang bersaing.</p><div><br></div>', NULL, '2021-05-30 23:06:38', '2021-05-30 23:06:38'),
(35, 'pilih-jenis-produk-yang-memang-mudah-untuk-dijual', 18, '1', 'Pilih Jenis Produk yang Memang Mudah untuk Dijual', '<span style=\"color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">Cara agar kamu dapat menjadi reseller yang sukses adalah kamu harus pintar memilih apa produk yang kamu ingin jual kembali. Jangan memilih produk yang tidak banyak pembelinya, karena kamu hanya akan menghabiskan modal promosi, tapi tidak ada keuntungan karena tidak ada pembeli. Bisnis kaos online adalah salah satu peluang reseller yang menjanjikan.</span>', NULL, '2021-05-30 23:07:28', '2021-05-31 04:17:01'),
(36, 'pilih-jenis-produk-yang-memang-mudah-untuk-dijual', 18, '2', 'Pilih Jenis Produk yang Memang Mudah untuk Dijual', '<p><span style=\"color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">Cara agar kamu dapat menjadi reseller yang sukses adalah kamu harus pintar memilih apa produk yang kamu ingin jual kembali. Jangan memilih produk yang tidak banyak pembelinya, karena kamu hanya akan menghabiskan modal promosi, tapi tidak ada keuntungan karena tidak ada pembeli. Bisnis kaos online adalah salah satu peluang reseller yang menjanjikan.</span><br></p>', NULL, '2021-05-30 23:07:28', '2021-05-30 23:07:28'),
(37, 'pilih-supplier-penjual-pertama-yang-besar-menguntungkan-dan-professional', 19, '1', 'Pilih Supplier (Penjual Pertama) yang Besar, Menguntungkan dan Professional', '<span style=\"color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">Setelah kamu memutuskan apa produk yang ingin kamu jual, kamu harus mencari&nbsp;</span><em style=\"color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">supplier</em><span style=\"color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">&nbsp;yang paling tepat. Pemilihan&nbsp;</span><em style=\"color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">supplier</em><span style=\"color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">&nbsp;didasarkan pada kapasitasnya untuk memasok produk memang sudah besar, harga yang diberikan menguntungkan kamu, dan bekerja secara profesional dalam melayani pesanan reseller.</span>', NULL, '2021-05-30 23:08:35', '2021-05-31 04:18:01'),
