(17, 10, 'strawberry-youghurt', 1, 'Strawberry Youghurt', 'Kandungan Vitamin B5 membuat kulit lebih lembap, lembut dan elastis , serta mempercepat produksi kolagen  sehingga sangat baik untuk penyembuhan luka', '<h3><div style=\"text-align: justify;\"><b style=\"font-size: 1.25rem; text-indent: 5.4pt;\"><span lang=\"EN-US\" style=\"font-size: 12pt; font-family: Helvetica, sans-serif;\"><span style=\"font-family: Poppins;\">&nbsp; &nbsp;Manfaat :</span></span></b></div><span style=\"font-size: 1.25rem; text-indent: 5.4pt; font-family: &quot;Times New Roman&quot;;\"><div style=\"text-align: justify;\"><span style=\"font-size: 1.25rem; text-indent: 5.4pt;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"text-indent: 5.4pt; font-size: 10pt;\">Membersihkan kulit dari debu dan kotoran yang menempel pada wajah sehingga menjadikan kulit terasa bersih, lembut dan menjaganya tetap sehat</span><span lang=\"IN\" style=\"text-indent: 5.4pt; font-size: 10pt;\">.&nbsp;</span><span style=\"font-size: 10pt; text-indent: 5.4pt;\">Dapat digunakan untuk semua jenis</span><span style=\"font-size: 10pt; text-indent: 5.4pt; letter-spacing: 0.3pt;\">&nbsp;</span><span style=\"font-family: Helvetica, sans-serif; font-size: 10pt; text-indent: 5.4pt;\"><span style=\"font-family: &quot;Times New Roman&quot;;\">kulit</span></span></div></span></h3><h3><div style=\"text-align: justify;\"><font face=\"Poppins\"><span style=\"font-size: 13.3333px;\"><br></span></font></div><span style=\"text-indent: 5.4pt;\"><div style=\"text-align: justify;\"><font face=\"Helvetica, sans-serif\"><span style=\"font-size: 13.3333px;\"><br></span></font></div></span><b style=\"font-size: 1.25rem; text-indent: 5.4pt;\"><div style=\"text-align: justify;\"><b style=\"font-size: 1.25rem; text-indent: 5.4pt;\"><span lang=\"IN\" style=\"font-size: 12pt; font-family: Helvetica, sans-serif;\"><span style=\"font-family: Poppins;\">Cara</span><span style=\"letter-spacing: 0.05pt; font-family: Poppins;\">&nbsp;</span><span style=\"font-family: Poppins;\">pemakaian :</span></span></b><span style=\"font-weight: 500; font-size: 1.25rem; text-indent: 5.4pt;\"><span style=\"font-family: Poppins;\">&nbsp;&nbsp;</span></span></div></b><span style=\"font-size: 1.25rem; text-indent: 5.4pt; font-family: &quot;Times New Roman&quot;;\"><div style=\"text-align: justify;\"><span style=\"font-size: 1.25rem; text-indent: 5.4pt;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span lang=\"IN\" style=\"text-indent: 5.4pt; font-size: 10pt;\">Basahi wajah dan leher dengan air</span><span lang=\"EN-US\" style=\"text-indent: 5.4pt; font-size: 10pt;\">, t</span><span lang=\"IN\" style=\"text-indent: 5.4pt; font-size: 10pt;\">uang sedikit cairan pada telapak tangan</span><span lang=\"EN-US\" style=\"text-indent: 5.4pt; font-size: 10pt;\">, g</span><span lang=\"IN\" style=\"text-indent: 5.4pt; font-size: 10pt; font-family: Helvetica, sans-serif;\"><span style=\"font-family: &quot;Times New Roman&quot;;\">osokkan kedua telapak tangan hingga berbusa.&nbsp;</span></span><span lang=\"IN\" style=\"text-indent: 5.4pt; font-size: 10pt;\">Usapkan secara merata pada seluru</span><span lang=\"EN-US\" style=\"text-indent: 5.4pt; font-size: 10pt;\">h&nbsp;</span><span lang=\"IN\" style=\"font-family: Poppins, Helvetica, sans-serif; text-indent: 5.4pt; font-size: 10pt;\"><span style=\"font-family: &quot;Times New Roman&quot;;\">wajah dan leher kemudian bilas dengan air hingga bersih. Gunakan dua kali sehari.&nbsp;</span></span><span lang=\"EN-US\" style=\"text-indent: 5.4pt; font-size: 10pt;\">D</span><span lang=\"IN\" style=\"text-indent: 5.4pt; font-size: 10pt;\">apat dilanjutkan dengan menggunakan SKIN TONER DERMA EXPRESS</span><span lang=\"EN-US\" style=\"text-indent: 5.4pt; font-size: 10pt;\">.</span></div></span></h3>', '2020-02-27 10:29:31', NULL, '2021-07-07 02:55:10'),
(18, 10, 'clarifying-gel', 2, 'CLARIFYING GEL', 'Kandungan Vitamin B5 membuat kulit lebih lembap, lembut dan elastis , serta mempercepat produksi kolagen  sehingga sangat baik untuk penyembuhan luka', '<h3><b style=\"font-size: 1.25rem; text-indent: 5.4pt;\"><span lang=\"EN-US\" style=\"font-size: 12pt; font-family: Helvetica, sans-serif;\"><span style=\"font-family: Poppins;\">Manfaat :</span><br></span></b><span style=\"font-size: 1.25rem; text-indent: 5.4pt; font-family: Poppins;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"text-indent: 5.4pt; font-size: 10pt; font-family: Poppins;\">Membersihkan kulit dari debu dan kotoran yang menempel pada wajah sehingga menjadikan kulit terasa bersih, lembut dan menjaganya tetap sehat</span><span lang=\"IN\" style=\"text-indent: 5.4pt; font-size: 10pt; font-family: Poppins;\">.&nbsp;</span><span style=\"font-family: Poppins; font-size: 10pt; text-indent: 5.4pt;\">Dapat digunakan untuk semua jenis</span><span style=\"font-family: Poppins; font-size: 10pt; text-indent: 5.4pt; letter-spacing: 0.3pt;\">&nbsp;</span><span style=\"font-family: Helvetica, sans-serif; font-size: 10pt; text-indent: 5.4pt;\"><span style=\"font-family: Poppins;\">kulit</span></span></h3><h3><span style=\"font-family: Helvetica, sans-serif; font-size: 10pt; text-indent: 5.4pt;\"><span style=\"font-family: Poppins;\"><br></span><br></span><b style=\"font-size: 1.25rem; text-indent: 5.4pt;\"><span lang=\"IN\" style=\"font-size: 12pt; font-family: Helvetica, sans-serif;\"><span style=\"font-family: Poppins;\">Cara</span><span style=\"letter-spacing: 0.05pt; font-family: Poppins;\">&nbsp;</span><span style=\"font-family: Poppins;\">pemakaian :</span></span></b><span style=\"font-size: 1.25rem; text-indent: 5.4pt;\"><span style=\"font-family: Poppins;\">&nbsp;&nbsp;</span><br></span><span style=\"font-size: 1.25rem; text-indent: 5.4pt; font-family: Poppins;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span lang=\"IN\" style=\"text-indent: 5.4pt; font-size: 10pt; font-family: Poppins;\">Basahi wajah dan leher dengan air</span><span lang=\"EN-US\" style=\"text-indent: 5.4pt; font-size: 10pt; font-family: Poppins;\">, t</span><span lang=\"IN\" style=\"text-indent: 5.4pt; font-size: 10pt; font-family: Poppins;\">uang sedikit cairan pada telapak tangan</span><span lang=\"EN-US\" style=\"text-indent: 5.4pt; font-size: 10pt; font-family: Poppins;\">, g</span><span lang=\"IN\" style=\"text-indent: 5.4pt; font-size: 10pt; font-family: Helvetica, sans-serif;\"><span style=\"font-family: Poppins;\">osokkan kedua telapak tangan hingga berbusa.&nbsp;</span></span><span lang=\"IN\" style=\"text-indent: 5.4pt; font-size: 10pt; font-family: Poppins;\">Usapkan secara merata pada seluru</span><span lang=\"EN-US\" style=\"text-indent: 5.4pt; font-size: 10pt; font-family: Poppins;\">h&nbsp;</span><span lang=\"IN\" style=\"text-indent: 5.4pt; font-size: 10pt;\"><span style=\"font-family: Poppins;\">wajah dan leher kemudian bilas dengan air hingga bersih. Gunakan dua kali sehari.&nbsp;</span></span><span lang=\"EN-US\" style=\"text-indent: 5.4pt; font-size: 10pt; font-family: Poppins;\">D</span><span lang=\"IN\" style=\"text-indent: 5.4pt; font-size: 10pt; font-family: Poppins;\">apat dilanjutkan dengan menggunakan SKIN TONER DERMA EXPRESS</span><span lang=\"EN-US\" style=\"text-indent: 5.4pt; font-size: 10pt; font-family: Poppins;\">.</span></h3>', '2020-02-27 10:29:31', NULL, '2021-05-28 00:04:48'),
