INSERT INTO `treatmentlanguage` (`id`, `id_treatment`, `seo`, `id_language`, `judul`, `resume`, `deskripsi`, `created_at`, `deleted_at`, `updated_at`) VALUES
(1, 1, 'facial', 1, 'Facial', 'Facial adalah Perawatan wajah non invasif yang umum dilakukan di klinik kecantikan dan prosesnya meliputi ekstraksi komedo, eksfoliasi, masker wajah dan pengaplikasian toner sehingga kulit wajah lebih cerah dan sehat.', '<p>Facial adalah Perawatan wajah non invasif yang umum dilakukan di klinik kecantikan dan prosesnya\r\nmeliputi ekstraksi komedo, eksfoliasi, masker wajah dan pengaplikasian toner sehingga kulit wajah\r\nlebih cerah dan sehat. Biasanya proses facial disesuaikan dengan jenis dan permasalahan kulit.</p><p>Manfaat facial wajah untuk kulit wajah tampak lebih bersih dan sehat:</p><ol><li>Membersihkan wajah<br>Salah satu prosedur dalam facial adalah pembersihan kulit wajah. Facial sangat baik untuk\r\nmembersihkan wajah secara menyeluruh yang tidak mungkin dilakukan di rumah. Dokter kecantikan\r\natau ahli estetika akan lebih memahami jenis kulit dan tahu apa yang perlu dilakukan untuk menjaga\r\nkesehatan kulit. Proses pembukaan pori-pori, pengelupasan, pemijatan, dan pemberian nutrisi\r\nmampu meningkatkan tampilan kulit wajah sekaligus menjaganya tetap sehat.<br><br></li><li>Mencegah Penuaan<br>Pada saat facial, sel-sel kulit mati dapat terangkat secara total, mencegah kulit kusam dan rusak.\r\nPemijatan yang dilakukan saat facial membantu meningkatkan regenerasi sel dan meningkatkan\r\nproduksi kolagen. Dokter kecantikan atau ahli estetika wajah menggunakan berbagai metode,\r\nproduk, dan teknologi yang membantu meningkatkan tekstur kulit. Metode ini dapat mendukung\r\nkulit tampak lebih muda dan mencegah penuaan dini.<br><br></li><li>Membantu Detoksifikasi <br>Facial berperan untuk mendetoksifikasi kulit dari sel-sel kulit mati dan residu yang menumpuk di\r\nkulit wajah. Residu di kulit wajah yang tidak diangkat dengan benar akan menyebabkan jerawat.\r\nFacial membantu menghilangkan kelebihan minyak dan racun di kulit wajah.<br><br></li><li>Mengurangi Komedo<br>Komedo bisa menyumbat pori-pori dan membuat kulit wajah tampak kusam. Proses facial mampu\r\nmengangkat komedo dan mencegah penyumbatan pada pori. Facial merupakan perawatan ideal\r\nuntuk komedo. Proses penguapan dan ekstraksi, diikuti dengan pijatan yang mampu membuka poripori serta membersihkan kulit secara mendalam.<br><br></li><li>Merawat Jerawat dan Bekasnya\r\n<br>Facial juga mampu mencegah dan merawat jerawat beserta bekasnya. Perawatan facial untuk wajah\r\nberjerawat memerlukan konsultasi dari dokter kecantikan yang ahli dibidangnya.</li></ol>', '2020-08-26 03:32:59', NULL, '2021-01-27 23:01:14'),
(2, 1, 'facial', 2, 'Facial', 'Facial adalah Perawatan wajah non invasif yang umum dilakukan di klinik kecantikan dan prosesnya meliputi ekstraksi komedo, eksfoliasi, masker wajah dan pengaplikasian toner sehingga kulit wajah lebih cerah dan sehat.', '<p>Facial adalah Perawatan wajah non invasif yang umum dilakukan di klinik kecantikan dan prosesnya\r\nmeliputi ekstraksi komedo, eksfoliasi, masker wajah dan pengaplikasian toner sehingga kulit wajah\r\nlebih cerah dan sehat. Biasanya proses facial disesuaikan dengan jenis dan permasalahan kulit.</p><p>Manfaat facial wajah untuk kulit wajah tampak lebih bersih dan sehat:</p><ol><li>Membersihkan wajah<br>Salah satu prosedur dalam facial adalah pembersihan kulit wajah. Facial sangat baik untuk\r\nmembersihkan wajah secara menyeluruh yang tidak mungkin dilakukan di rumah. Dokter kecantikan\r\natau ahli estetika akan lebih memahami jenis kulit dan tahu apa yang perlu dilakukan untuk menjaga\r\nkesehatan kulit. Proses pembukaan pori-pori, pengelupasan, pemijatan, dan pemberian nutrisi\r\nmampu meningkatkan tampilan kulit wajah sekaligus menjaganya tetap sehat.<br><br></li><li>Mencegah Penuaan<br>Pada saat facial, sel-sel kulit mati dapat terangkat secara total, mencegah kulit kusam dan rusak.\r\nPemijatan yang dilakukan saat facial membantu meningkatkan regenerasi sel dan meningkatkan\r\nproduksi kolagen. Dokter kecantikan atau ahli estetika wajah menggunakan berbagai metode,\r\nproduk, dan teknologi yang membantu meningkatkan tekstur kulit. Metode ini dapat mendukung\r\nkulit tampak lebih muda dan mencegah penuaan dini.<br><br></li><li>Membantu Detoksifikasi <br>Facial berperan untuk mendetoksifikasi kulit dari sel-sel kulit mati dan residu yang menumpuk di\r\nkulit wajah. Residu di kulit wajah yang tidak diangkat dengan benar akan menyebabkan jerawat.\r\nFacial membantu menghilangkan kelebihan minyak dan racun di kulit wajah.<br><br></li><li>Mengurangi Komedo<br>Komedo bisa menyumbat pori-pori dan membuat kulit wajah tam