(3, 2, 'botox-rahang', 1, 'Botox Rahang', 'Manfaat dari botox rahang antara lain meniruskan pipi, menghapus kerutan akibat proses penuaan dan menghaluskan garis-garis halus akibat gerakan wajah. Misalnya, smile lines, kerutan dahi atau alis, dan ujung bibir saat cemberut.', '<p><span style=\"color: rgb(85, 85, 85); font-family: opensans-regular; font-size: 16px; text-align: justify;\">Manfaat dari botox rahang antara lain meniruskan pipi, menghapus kerutan akibat proses penuaan dan menghaluskan garis-garis halus akibat gerakan wajah. Misalnya, smile lines, kerutan dahi atau alis, dan ujung bibir saat cemberut.</span><br></p>', '2020-08-26 03:44:49', NULL, '2021-01-27 01:13:15'),
(4, 2, 'botox-rahang', 2, 'Botox Rahang', NULL, '<p><span style=\"color: rgb(85, 85, 85); font-family: opensans-regular; font-size: 16px; text-align: justify;\">Manfaat dari botox rahang antara lain meniruskan pipi, menghapus kerutan akibat proses penuaan dan menghaluskan garis-garis halus akibat gerakan wajah. Misalnya, smile lines, kerutan dahi atau alis, dan ujung bibir saat cemberut.</span><br></p>', '2020-08-26 03:44:49', NULL, '2020-08-26 03:44:49'),
